(22, 2, NULL, 'আওয়ামী লীগের সহযোগী সংগঠনের পর এবার তৃণমূল পর্যায়ের কমিটি থেকেও বিতর্কিত ব্যক্তিদের বাদ দেওয়ার নির্দেশনা দেওয়া হয়েছে।', 'ধানমন্ত্রী শেখ হাসিনা বৃহস্পতিবার আজারবাইজানের বাকু যাওয়ার আগে সাধারণ সম্পাদক ওবায়দুল কাদেরকে এ নির্দেশনা দেন। পরে ওবায়দুল', 'আওয়ামী লীগের সহযোগী সংগঠনের পর এবার তৃণমূল পর্যায়ের কমিটি থেকেও বিতর্কিত ব্যক্তিদের বাদ দেওয়ার নির্দেশনা দেওয়া হয়েছে।', 1, 1, '<p>আওয়ামী লীগের সহযোগী সংগঠনের পর এবার তৃণমূল পর্যায়ের কমিটি থেকেও বিতর্কিত ব্যক্তিদের বাদ দেওয়ার নির্দেশনা দেওয়া হয়েছে। গতকাল শুক্রবার থেকে সাংগঠনিক জেলার সভাপতি ও সাধারণ সম্পাদকদের কাছে এ-সংক্রান্ত নির্দেশনাসংবলিত চিঠি পাঠানো শুরু হয়েছে। এটি সম্প্রতি শুরু হওয়া ‘শুদ্ধি’ অভিযানের অংশ বলে দলটির নীতিনির্ধারণী সূত্র থেকে বলা হয়েছে।</p><p>সূত্র জানায়, প্রধানমন্ত্রী শেখ হাসিনা বৃহস্পতিবার আজারবাইজানের বাকু যাওয়ার আগে সাধারণ সম্পাদক ওবায়দুল কাদেরকে এ নির্দেশনা দেন। পরে ওবায়দুল কাদেরের সই করা চিঠি সাংগঠনিক জেলা ও মহানগরে পাঠানো শুরু হয়। কুরিয়ার সার্ভিসের মাধ্যমে পাঠানোর কারণে তৃণমূলের নেতারা আজ বা কাল থেকে চিঠি পাওয়া শুরু করবেন। ক্যাসিনো, জুয়া, অবৈধ সম্পদ অর্জনের বিরুদ্ধে চলমান অভিযান এত দিন আওয়ামী লীগের সহযোগী সংগঠনগুলোর মধ্যে সীমাবদ্ধ ছিল। ধীরে ধীরে তা মূল সংগঠন আওয়ামী লীগের বিভিন্ন স্তর ও জনপ্রতিনিধিদের মধ্যে বিস্তৃত হচ্ছে। জনপ্রতিনিধিদের মধ্যে মন্ত্রী, সাংসদ ও স্থানীয় সরকারের নির্বাচিত প্রতিনিধিদেরও অভিযানের আওতায় আনা হচ্ছে। ইতিমধ্যে সাংসদ নুরুন্নবী চৌধুরী ওরফে শাওন ও হুইপ সামশুল হক চৌধুরীসহ ২২ জনের বিদেশ যাওয়ায় নিষেধাজ্ঞা দেওয়া হয়েছে। সাংসদ নজরুল ইসলাম ওরফে বাবু ও তাঁর পরিবারের সদস্যদের ব্যাংক হিসাব তলব করা হয়েছে।</p><p>আগামী ২০-২১ ডিসেম্বর আওয়ামী লীগের জাতীয় সম্মেলন। এবারের সম্মেলনে দলের কেন্দ্রীয় কমিটি থেকেও বিতর্কিত নেতারা বাদ পড়বেন বলে দলীয় প্রধান শেখ হাসিনা ইঙ্গিত দিয়েছেন। নভেম্বরে যুবলীগ, স্বেচ্ছাসেবক লীগ, কৃষক লীগসহ সহযোগী সংগঠনগুলোর সম্মেলন। এ জন্য এসব সংগঠন থেকে বিতর্কিতদের বাদ দেওয়ার প্রক্রিয়া শুরু হয়েছে। এখন জেলা ও উপজেলা, এমনকি ইউনিয়ন পর্যায়েও এ প্রক্রিয়া বিস্তৃত হচ্ছে।</p><p>সরকার ও আওয়ামী লীগের দায়িত্বশীল সূত্র জানায়, প্রধানমন্ত্রী শেখ হাসিনা সাংগঠনিক ও প্রশাসনিক দুভাবেই তাঁর বার্তা পাঠাচ্ছেন। দলীয়ভাবে কিছু নির্দেশনা দিচ্ছেন চিঠি দিয়ে। কাউকে কাউকে মৌখিক ও বার্তাবাহকের মাধ্যমে সংগঠন থেকে বাদ দেওয়ার ঘোষণা দিচ্ছেন। অন্যদিকে গোয়েন্দা সংস্থা ও আইনশৃঙ্খলা রক্ষাকারী বাহিনীগুলোকে সরাসরি বার্তা দেওয়া হয়েছে। তাদের প্রথমে ব্যক্তি চিহ্নিত করা, এরপর তথ্য সংগ্রহ এবং শেষে গ্রেপ্তারের নির্দেশনা দেওয়া হয়েছে। চিহ্নিত কেউ যাতে বিদেশে পালাতে না পারেন, সেটিও নিশ্চিত করার কথা বলা হয়েছে। গোয়েন্দা সংস্থা ও আইনশৃঙ্খলা রক্ষাকারী বাহিনীগুলো যে বিষয়গুলো নিয়ে কাজ করছে, সেগুলো হচ্ছে ক্যাসিনো ও জুয়ার সঙ্গে সংশ্লিষ্ট ব্যক্তি, নব্য আওয়ামী লীগার হয়ে ক্ষমতার দাপট দেখানো এবং বিতর্কিত কর্মকাণ্ডের সঙ্গে যুক্ত ও অবৈধ সম্পদ অর্জন।</p><p>আওয়ামী লীগে ‘শুদ্ধি’ অভিযান<br>১৮ সেপ্টেম্বর থেকে এ পর্যন্ত ৪৮টি অভিযান<br>সাংসদ, হুইপসহ ২২ জনের বিদেশ যাওয়ায় নিষেধাজ্ঞা<br>জেলার সভাপতি-সম্পাদকদের কাছে চিঠি যাচ্ছে<br>খোঁজ নিতে বলা হয়েছে আইনশৃঙ্খলা রক্ষাকারী বাহিনীকে</p><p>আওয়ামী লীগের কেন্দ্রীয় দায়িত্বশীল সূত্র জানায়, সাংগঠনিক জেলা ও মহানগর কমিটিকে সপ্তাহ দুয়েক আগেও একবার চিঠি দিয়ে দ্রুত সম্মেলন করার নির্দেশনা দেওয়া হয়েছিল। বৃহস্পতিবারের চিঠিতে বিতর্কিত ও অনুপ্রবেশকারীরা যাতে কোনোভাবেই দলে কোনো পদ পেতে না পারেন, সে বিষয়টি নিশ্চিত করার নির্দেশনা দেওয়া হয়েছে। এমনকি সম্মেলন প্রস্তুতি কমিটিতেও বিতর্কিতদের না রাখার কথা বলা হয়েছে। চিঠিতে আগামী ১০ ডিসেম্বরের মধ্যে সাংগঠনিক জেলা ও মহানগরের অধীন সব স্তরে সম্মেলন করে নতুন নেতৃত্ব প্রতিষ্ঠা করার পরামর্শ দেওয়া হয়েছে।</p><p>জানতে চাইলে আওয়ামী লীগের যুগ্ম সাধারণ সম্পাদক মাহবুব উল আলম হানিফ প্রথম আলোকে বলেন, টানা ১১ বছর ক্ষমতায় থাকার কারণে অনেকের বিতর্কিত কর্মকাণ্ডের জন্য দল বিব্রত হচ্ছে। এ জন্য বিতর্কিতদের ব্যাপারে দলীয় প্রধান শেখ হাসিনা খুবই কঠোর অবস্থান নিয়েছেন। দলের কোনো স্তরেই বিতর্কিতরা থাকতে পারবেন না। তৃণমূলের কমিটিতে যাতে বিতর্কিতরা স্থান না পান, সে ব্যাপারে জেলা ও মহানগর নেতাদের তদারক করতে বলা হয়েছে। অন্য দল থেকে আওয়ামী লীগে আসা ব্যক্তিদের বিষয়ে তিনি বলেন, যুদ্ধাপরাধ, সন্ত্রাস ও নাশকতার মামলার আসামিদের আওয়ামী লীগে স্থান হবে না—এই নীতিমালা আগেই নেওয়া আছে। এরপরও কোথাও কোথাও অন্য দলের এমন লোক ঢুকে পড়েছেন, তাঁদের এবার বাদ দেওয়া হবে।</p><p>বিতর্কিতদের কীভাবে চিহ্নিত করা হবে এবং জেলা বা মহানগর কমিটি তাঁদের বাদ দেওয়ার ক্ষমতা রাখে কি না, এ নিয়ে জেলা পর্যায়ের নেতারা কিছুটা দ্বিধান্বিত। তবে কেন্দ্রীয় একাধিক নেতা জানিয়েছেন, জেলা পর্যায়ে সম্মেলন প্রস্তুতি কমিটি বা নতুন কমিটি করার ক্ষেত্রে দলের প্রধান শেখ হাসিনা আগেই বার্তা দিয়ে থাকেন। সে ক্ষেত্রে জেলা নেতাদের অনানুষ্ঠানিকভাবে ব্যক্তি ধরে ধরে বার্তা দেওয়া হবে।</p><p>আওয়ামী লীগের একজন কেন্দ্রীয় নেতা নাম প্রকাশ না করার শর্তে প্রথম আলোকে বলেন, আওয়ামী লীগের বিভিন্ন স্তরে দুর্নীতি ও অনিয়ম এমনভাবে ঢুকে পড়েছে, কোনো ঝড় এলেই দল বিপর্যস্ত হয়ে পড়বে। সম্পদের পাহাড় গড়ে তোলার কারণে নেতা-কর্মীদের মধ্যে অবিশ্বাস প্রকট। ফলে আওয়ামী লীগের শত্রু এখন আওয়ামী লীগই। সব স্তরে শুদ্ধি অভিযান চললে দলই শক্তিশালী হবে। এ জন্যই চলমান অভিযানের বিকল্প নেই।</p><p>গত মাস থেকে শুদ্ধি অভিযান শুরু হয়েছে। জাহাঙ্গীরনগর বিশ্ববিদ্যালয়ের উন্নয়ন প্রকল্প থেকে চাঁদাবাজিসহ নানা অভিযোগে প্রথমে ছাত্রলীগের সভাপতি রেজওয়ানুল হক চৌধুরী ও সাধারণ সম্পাদক গোলাম রাব্বানীকে বাদ দেওয়া হয়।</p><p>এরপর যুবলীগের কেন্দ্রীয় সাংগঠনিক সম্পাদক খালেদ আহমেদ ভূঁইয়া, ঢাকা মহানগর দক্ষিণ শাখার সভাপতি ইসমাইল হোসেন চৌধুরী ওরফে সম্রাট, কথিত যুবলীগ নেতা জি কে শামীমসহ বেশ কয়েকজনকে ক্যাসিনো ও জুয়া-কাণ্ড এবং অবৈধ অর্থ উপার্জনের দায়ে গ্রেপ্তার করা হয়। এসব অনৈতিক কর্মকাণ্ডে সহযোগিতার অভিযোগে যুবলীগ চেয়ারম্যান ওমর ফারুক চৌধুরীকে সাংগঠনিক কর্মকাণ্ড থেকে বাদ দেওয়া হয়। তাঁর বিদেশ যাওয়া নিষেধ, ব্যাংক হিসাবও জব্দ। স্বেচ্ছাসেবক লীগের সভাপতি মোল্লা আবু কাওছার এবং সাধারণ সম্পাদক পঙ্কজ নাথও দায়িত্ব থেকে বাদ পড়েছেন।</p><p>দুর্নীতি দমন কমিশন (দুদক) এরই মধ্যে তিন সাংসদসহ ২৩ জনের বিদেশযাত্রায় নিষেধাজ্ঞা দিয়েছে। পুলিশের বিশেষ শাখার (এসবি) বিশেষ পুলিশ সুপার (ইমিগ্রেশন) বরাবর চিঠি দিয়ে তাঁদের বিদেশযাত্রা ঠেকাতে কার্যকর ব্যবস্থা নিতে অনুরোধ করা হয়েছে। জাতীয় রাজস্ব বোর্ড (এনবিআর) অনেকের ব্যাংক হিসাব জব্দ করেছে।</p><p>আওয়ামী লীগের সভাপতিমণ্ডলীর সদস্য ও ১৪ দলের মুখপাত্র মোহাম্মদ নাসিম প্রথম আলোকে বলেন, টানা ক্ষমতায় থাকার কারণে আওয়ামী লীগের সব স্তরেই অর্থবিত্ত ও অবৈধ ক্ষমতার অধিকারী সৃষ্টি হয়েছে। তাঁদের কারণে ত্যাগী ও পোড় খাওয়া অনেক নেতা-কর্মী দূরে সরে গেছেন। দলের সুনাম নষ্ট হয়েছে, নেতৃত্বে ঘুণ ধরেছে। এখন সুযোগসন্ধানীদের বের করার কাজ শুরু হয়েছে।</p>', 17, NULL, NULL, '2019-10-26 00:30:00', '2019-10-26 00:30:00', 1, '1', NULL, NULL, NULL, 1, 1, NULL, '2020-02-06 17:20:09', '2019-10-26 12:33:52', '2020-02-06 17:20:09'),
(23, 2, NULL, 'আওয়ামী লীগের সহযোগী সংগঠনের পর এবার তৃণমূল পর্যায়ের কমিটি থেকেও', 'আওয়ামী লীগের সহযোগী সংগঠনের পর এবার তৃণমূল পর্যায়ের কমিটি থেকেও', 'আওয়ামী লীগের সহযোগী সংগঠনের পর এবার তৃণমূল পর্যায়ের কমিটি থেকেও', 1, 1, '<p>আওয়ামী লীগের সহযোগী সংগঠনের পর এবার তৃণমূল পর্যায়ের কমিটি থেকেও বিতর্কিত ব্যক্তিদের বাদ দেওয়ার নির্দেশনা দেওয়া হয়েছে। গতকাল শুক্রবার থেকে সাংগঠনিক জেলার সভাপতি ও সাধারণ সম্পাদকদের কাছে এ-সংক্রান্ত নির্দেশনাসংবলিত চিঠি পাঠানো শুরু হয়েছে। এটি সম্প্রতি শুরু হওয়া ‘শুদ্ধি’ অভিযানের অংশ বলে দলটির নীতিনির্ধারণী সূত্র থেকে বলা হয়েছে।</p><p>সূত্র জানায়, প্রধানমন্ত্রী শেখ হাসিনা বৃহস্পতিবার আজারবাইজানের বাকু যাওয়ার আগে সাধারণ সম্পাদক ওবায়দুল কাদেরকে এ নির্দেশনা দেন। পরে ওবায়দুল কাদেরের সই করা চিঠি সাংগঠনিক জেলা ও মহানগরে পাঠানো শুরু হয়। কুরিয়ার সার্ভিসের মাধ্যমে পাঠানোর কারণে তৃণমূলের নেতারা আজ বা কাল থেকে চিঠি পাওয়া শুরু করবেন। ক্যাসিনো, জুয়া, অবৈধ সম্পদ অর্জনের বিরুদ্ধে চলমান অভিযান এত দিন আওয়ামী লীগের সহযোগী সংগঠনগুলোর মধ্যে সীমাবদ্ধ ছিল। ধীরে ধীরে তা মূল সংগঠন আওয়ামী লীগের বিভিন্ন স্তর ও জনপ্রতিনিধিদের মধ্যে বিস্তৃত হচ্ছে। জনপ্রতিনিধিদের মধ্যে মন্ত্রী, সাংসদ ও স্থানীয় সরকারের নির্বাচিত প্রতিনিধিদেরও অভিযানের আওতায় আনা হচ্ছে। ইতিমধ্যে সাংসদ নুরুন্নবী চৌধুরী ওরফে শাওন ও হুইপ সামশুল হক চৌধুরীসহ ২২ জনের বিদেশ যাওয়ায় নিষেধাজ্ঞা দেওয়া হয়েছে। সাংসদ নজরুল ইসলাম ওরফে বাবু ও তাঁর পরিবারের সদস্যদের ব্যাংক হিসাব তলব করা হয়েছে।</p><p>আগামী ২০-২১ ডিসেম্বর আওয়ামী লীগের জাতীয় সম্মেলন। এবারের সম্মেলনে দলের কেন্দ্রীয় কমিটি থেকেও বিতর্কিত নেতারা বাদ পড়বেন বলে দলীয় প্রধান শেখ হাসিনা ইঙ্গিত দিয়েছেন। নভেম্বরে যুবলীগ, স্বেচ্ছাসেবক লীগ, কৃষক লীগসহ সহযোগী সংগঠনগুলোর সম্মেলন। এ জন্য এসব সংগঠন থেকে বিতর্কিতদের বাদ দেওয়ার প্রক্রিয়া শুরু হয়েছে। এখন জেলা ও উপজেলা, এমনকি ইউনিয়ন পর্যায়েও এ প্রক্রিয়া বিস্তৃত হচ্ছে।</p><p>সরকার ও আওয়ামী লীগের দায়িত্বশীল সূত্র জানায়, প্রধানমন্ত্রী শেখ হাসিনা সাংগঠনিক ও প্রশাসনিক দুভাবেই তাঁর বার্তা পাঠাচ্ছেন। দলীয়ভাবে কিছু নির্দেশনা দিচ্ছেন চিঠি দিয়ে। কাউকে কাউকে মৌখিক ও বার্তাবাহকের মাধ্যমে সংগঠন থেকে বাদ দেওয়ার ঘোষণা দিচ্ছেন। অন্যদিকে গোয়েন্দা সংস্থা ও আইনশৃঙ্খলা রক্ষাকারী বাহিনীগুলোকে সরাসরি বার্তা দেওয়া হয়েছে। তাদের প্রথমে ব্যক্তি চিহ্নিত করা, এরপর তথ্য সংগ্রহ এবং শেষে গ্রেপ্তারের নির্দেশনা দেওয়া হয়েছে। চিহ্নিত কেউ যাতে বিদেশে পালাতে না পারেন, সেটিও নিশ্চিত করার কথা বলা হয়েছে। গোয়েন্দা সংস্থা ও আইনশৃঙ্খলা রক্ষাকারী বাহিনীগুলো যে বিষয়গুলো নিয়ে কাজ করছে, সেগুলো হচ্ছে ক্যাসিনো ও জুয়ার সঙ্গে সংশ্লিষ্ট ব্যক্তি, নব্য আওয়ামী লীগার হয়ে ক্ষমতার দাপট দেখানো এবং বিতর্কিত কর্মকাণ্ডের সঙ্গে যুক্ত ও অবৈধ সম্পদ অর্জন।</p><p>আওয়ামী লীগে ‘শুদ্ধি’ অভিযান<br>১৮ সেপ্টেম্বর থেকে এ পর্যন্ত ৪৮টি অভিযান<br>সাংসদ, হুইপসহ ২২ জনের বিদেশ যাওয়ায় নিষেধাজ্ঞা<br>জেলার সভাপতি-সম্পাদকদের কাছে চিঠি যাচ্ছে<br>খোঁজ নিতে বলা হয়েছে আইনশৃঙ্খলা রক্ষাকারী বাহিনীকে</p><p>আওয়ামী লীগের কেন্দ্রীয় দায়িত্বশীল সূত্র জানায়, সাংগঠনিক জেলা ও মহানগর কমিটিকে সপ্তাহ দুয়েক আগেও একবার চিঠি দিয়ে দ্রুত সম্মেলন করার নির্দেশনা দেওয়া হয়েছিল। বৃহস্পতিবারের চিঠিতে বিতর্কিত ও অনুপ্রবেশকারীরা যাতে কোনোভাবেই দলে কোনো পদ পেতে না পারেন, সে বিষয়টি নিশ্চিত করার নির্দেশনা দেওয়া হয়েছে। এমনকি সম্মেলন প্রস্তুতি কমিটিতেও বিতর্কিতদের না রাখার কথা বলা হয়েছে। চিঠিতে আগামী ১০ ডিসেম্বরের মধ্যে সাংগঠনিক জেলা ও মহানগরের অধীন সব স্তরে সম্মেলন করে নতুন নেতৃত্ব প্রতিষ্ঠা করার পরামর্শ দেওয়া হয়েছে।</p><p>জানতে চাইলে আওয়ামী লীগের যুগ্ম সাধারণ সম্পাদক মাহবুব উল আলম হানিফ প্রথম আলোকে বলেন, টানা ১১ বছর ক্ষমতায় থাকার কারণে অনেকের বিতর্কিত কর্মকাণ্ডের জন্য দল বিব্রত হচ্ছে। এ জন্য বিতর্কিতদের ব্যাপারে দলীয় প্রধান শেখ হাসিনা খুবই কঠোর অবস্থান নিয়েছেন। দলের কোনো স্তরেই বিতর্কিতরা থাকতে পারবেন না। তৃণমূলের কমিটিতে যাতে বিতর্কিতরা স্থান না পান, সে ব্যাপারে জেলা ও মহানগর নেতাদের তদারক করতে বলা হয়েছে। অন্য দল থেকে আওয়ামী লীগে আসা ব্যক্তিদের বিষয়ে তিনি বলেন, যুদ্ধাপরাধ, সন্ত্রাস ও নাশকতার মামলার আসামিদের আওয়ামী লীগে স্থান হবে না—এই নীতিমালা আগেই নেওয়া আছে। এরপরও কোথাও কোথাও অন্য দলের এমন লোক ঢুকে পড়েছেন, তাঁদের এবার বাদ দেওয়া হবে।</p><p>বিতর্কিতদের কীভাবে চিহ্নিত করা হবে এবং জেলা বা মহানগর কমিটি তাঁদের বাদ দেওয়ার ক্ষমতা রাখে কি না, এ নিয়ে জেলা পর্যায়ের নেতারা কিছুটা দ্বিধান্বিত। তবে কেন্দ্রীয় একাধিক নেতা জানিয়েছেন, জেলা পর্যায়ে সম্মেলন প্রস্তুতি কমিটি বা নতুন কমিটি করার ক্ষেত্রে দলের প্রধান শেখ হাসিনা আগেই বার্তা দিয়ে থাকেন। সে ক্ষেত্রে জেলা নেতাদের অনানুষ্ঠানিকভাবে ব্যক্তি ধরে ধরে বার্তা দেওয়া হবে।</p><p>আওয়ামী লীগের একজন কেন্দ্রীয় নেতা নাম প্রকাশ না করার শর্তে প্রথম আলোকে বলেন, আওয়ামী লীগের বিভিন্ন স্তরে দুর্নীতি ও অনিয়ম এমনভাবে ঢুকে পড়েছে, কোনো ঝড় এলেই দল বিপর্যস্ত হয়ে পড়বে। সম্পদের পাহাড় গড়ে তোলার কারণে নেতা-কর্মীদের মধ্যে অবিশ্বাস প্রকট। ফলে আওয়ামী লীগের শত্রু এখন আওয়ামী লীগই। সব স্তরে শুদ্ধি অভিযান চললে দলই শক্তিশালী হবে। এ জন্যই চলমান অভিযানের বিকল্প নেই।</p><p>গত মাস থেকে শুদ্ধি অভিযান শুরু হয়েছে। জাহাঙ্গীরনগর বিশ্ববিদ্যালয়ের উন্নয়ন প্রকল্প থেকে চাঁদাবাজিসহ নানা অভিযোগে প্রথমে ছাত্রলীগের সভাপতি রেজওয়ানুল হক চৌধুরী ও সাধারণ সম্পাদক গোলাম রাব্বানীকে বাদ দেওয়া হয়।</p><p>এরপর যুবলীগের কেন্দ্রীয় সাংগঠনিক সম্পাদক খালেদ আহমেদ ভূঁইয়া, ঢাকা মহানগর দক্ষিণ শাখার সভাপতি ইসমাইল হোসেন চৌধুরী ওরফে সম্রাট, কথিত যুবলীগ নেতা জি কে শামীমসহ বেশ কয়েকজনকে ক্যাসিনো ও জুয়া-কাণ্ড এবং অবৈধ অর্থ উপার্জনের দায়ে গ্রেপ্তার করা হয়। এসব অনৈতিক কর্মকাণ্ডে সহযোগিতার অভিযোগে যুবলীগ চেয়ারম্যান ওমর ফারুক চৌধুরীকে সাংগঠনিক কর্মকাণ্ড থেকে বাদ দেওয়া হয়। তাঁর বিদেশ যাওয়া নিষেধ, ব্যাংক হিসাবও জব্দ। স্বেচ্ছাসেবক লীগের সভাপতি মোল্লা আবু কাওছার এবং সাধারণ সম্পাদক পঙ্কজ নাথও দায়িত্ব থেকে বাদ পড়েছেন।</p><p>দুর্নীতি দমন কমিশন (দুদক) এরই মধ্যে তিন সাংসদসহ ২৩ জনের বিদেশযাত্রায় নিষেধাজ্ঞা দিয়েছে। পুলিশের বিশেষ শাখার (এসবি) বিশেষ পুলিশ সুপার (ইমিগ্রেশন) বরাবর চিঠি দিয়ে তাঁদের বিদেশযাত্রা ঠেকাতে কার্যকর ব্যবস্থা নিতে অনুরোধ করা হয়েছে। জাতীয় রাজস্ব বোর্ড (এনবিআর) অনেকের ব্যাংক হিসাব জব্দ করেছে।</p><p>আওয়ামী লীগের সভাপতিমণ্ডলীর সদস্য ও ১৪ দলের মুখপাত্র মোহাম্মদ নাসিম প্রথম আলোকে বলেন, টানা ক্ষমতায় থাকার কারণে আওয়ামী লীগের সব স্তরেই অর্থবিত্ত ও অবৈধ ক্ষমতার অধিকারী সৃষ্টি হয়েছে। তাঁদের কারণে ত্যাগী ও পোড় খাওয়া অনেক নেতা-কর্মী দূরে সরে গেছেন। দলের সুনাম নষ্ট হয়েছে, নেতৃত্বে ঘুণ ধরেছে। এখন সুযোগসন্ধানীদের বের করার কাজ শুরু হয়েছে।</p>', 6, NULL, NULL, NULL, NULL, 1, '0', NULL, NULL, NULL, 1, 1, NULL, '2020-02-06 17:20:06', '2019-10-26 12:51:33', '2020-02-06 17:20:06'),
(24, 2, NULL, 'আওয়ামী লীগের সহযোগী সংগঠনের পর এবার তৃণমূল পর্যায়ের কমিটি থেকেও', 'আওয়ামী লীগের সহযোগী সংগঠনের পর এবার তৃণমূল পর্যায়ের কমিটি থেকেও', 'আওয়ামী লীগের সহযোগী সংগঠনের পর এবার তৃণমূল পর্যায়ের কমিটি থেকেও', 1, 1, '<p>আওয়ামী লীগের সহযোগী সংগঠনের পর এবার তৃণমূল পর্যায়ের কমিটি থেকেও বিতর্কিত ব্যক্তিদের বাদ দেওয়ার নির্দেশনা দেওয়া হয়েছে। গতকাল শুক্রবার থেকে সাংগঠনিক জেলার সভাপতি ও সাধারণ সম্পাদকদের কাছে এ-সংক্রান্ত নির্দেশনাসংবলিত চিঠি পাঠানো শুরু হয়েছে। এটি সম্প্রতি শুরু হওয়া ‘শুদ্ধি’ অভিযানের অংশ বলে দলটির নীতিনির্ধারণী সূত্র থেকে বলা হয়েছে।</p><p>সূত্র জানায়, প্রধানমন্ত্রী শেখ হাসিনা বৃহস্পতিবার আজারবাইজানের বাকু যাওয়ার আগে সাধারণ সম্পাদক ওবায়দুল কাদেরকে এ নির্দেশনা দেন। পরে ওবায়দুল কাদেরের সই করা চিঠি সাংগঠনিক জেলা ও মহানগরে পাঠানো শুরু হয়। কুরিয়ার সার্ভিসের মাধ্যমে পাঠানোর কারণে তৃণমূলের নেতারা আজ বা কাল থেকে চিঠি পাওয়া শুরু করবেন। ক্যাসিনো, জুয়া, অবৈধ সম্পদ অর্জনের বিরুদ্ধে চলমান অভিযান এত দিন আওয়ামী লীগের সহযোগী সংগঠনগুলোর মধ্যে সীমাবদ্ধ ছিল। ধীরে ধীরে তা মূল সংগঠন আওয়ামী লীগের বিভিন্ন স্তর ও জনপ্রতিনিধিদের মধ্যে বিস্তৃত হচ্ছে। জনপ্রতিনিধিদের মধ্যে মন্ত্রী, সাংসদ ও স্থানীয় সরকারের নির্বাচিত প্রতিনিধিদেরও অভিযানের আওতায় আনা হচ্ছে। ইতিমধ্যে সাংসদ নুরুন্নবী চৌধুরী ওরফে শাওন ও হুইপ সামশুল হক চৌধুরীসহ ২২ জনের বিদেশ যাওয়ায় নিষেধাজ্ঞা দেওয়া হয়েছে। সাংসদ নজরুল ইসলাম ওরফে বাবু ও তাঁর পরিবারের সদস্যদের ব্যাংক হিসাব তলব করা হয়েছে।</p><p>আগামী ২০-২১ ডিসেম্বর আওয়ামী লীগের জাতীয় সম্মেলন। এবারের সম্মেলনে দলের কেন্দ্রীয় কমিটি থেকেও বিতর্কিত নেতারা বাদ পড়বেন বলে দলীয় প্রধান শেখ হাসিনা ইঙ্গিত দিয়েছেন। নভেম্বরে যুবলীগ, স্বেচ্ছাসেবক লীগ, কৃষক লীগসহ সহযোগী সংগঠনগুলোর সম্মেলন। এ জন্য এসব সংগঠন থেকে বিতর্কিতদের বাদ দেওয়ার প্রক্রিয়া শুরু হয়েছে। এখন জেলা ও উপজেলা, এমনকি ইউনিয়ন পর্যায়েও এ প্রক্রিয়া বিস্তৃত হচ্ছে।</p><p>সরকার ও আওয়ামী লীগের দায়িত্বশীল সূত্র জানায়, প্রধানমন্ত্রী শেখ হাসিনা সাংগঠনিক ও প্রশাসনিক দুভাবেই তাঁর বার্তা পাঠাচ্ছেন। দলীয়ভাবে কিছু নির্দেশনা দিচ্ছেন চিঠি দিয়ে। কাউকে কাউকে মৌখিক ও বার্তাবাহকের মাধ্যমে সংগঠন থেকে বাদ দেওয়ার ঘোষণা দিচ্ছেন। অন্যদিকে গোয়েন্দা সংস্থা ও আইনশৃঙ্খলা রক্ষাকারী বাহিনীগুলোকে সরাসরি বার্তা দেওয়া হয়েছে। তাদের প্রথমে ব্যক্তি চিহ্নিত করা, এরপর তথ্য সংগ্রহ এবং শেষে গ্রেপ্তারের নির্দেশনা দেওয়া হয়েছে। চিহ্নিত কেউ যাতে বিদেশে পালাতে না পারেন, সেটিও নিশ্চিত করার কথা বলা হয়েছে। গোয়েন্দা সংস্থা ও আইনশৃঙ্খলা রক্ষাকারী বাহিনীগুলো যে বিষয়গুলো নিয়ে কাজ করছে, সেগুলো হচ্ছে ক্যাসিনো ও জুয়ার সঙ্গে সংশ্লিষ্ট ব্যক্তি, নব্য আওয়ামী লীগার হয়ে ক্ষমতার দাপট দেখানো এবং বিতর্কিত কর্মকাণ্ডের সঙ্গে যুক্ত ও অবৈধ সম্পদ অর্জন।</p><p>আওয়ামী লীগে ‘শুদ্ধি’ অভিযান<br>১৮ সেপ্টেম্বর থেকে এ পর্যন্ত ৪৮টি অভিযান<br>সাংসদ, হুইপসহ ২২ জনের বিদেশ যাওয়ায় নিষেধাজ্ঞা<br>জেলার সভাপতি-সম্পাদকদের কাছে চিঠি যাচ্ছে<br>খোঁজ নিতে বলা হয়েছে আইনশৃঙ্খলা রক্ষাকারী বাহিনীকে</p><p>আওয়ামী লীগের কেন্দ্রীয় দায়িত্বশীল সূত্র জানায়, সাংগঠনিক জেলা ও মহানগর কমিটিকে সপ্তাহ দুয়েক আগেও একবার চিঠি দিয়ে দ্রুত সম্মেলন করার নির্দেশনা দেওয়া হয়েছিল। বৃহস্পতিবারের চিঠিতে বিতর্কিত ও অনুপ্রবেশকারীরা যাতে কোনোভাবেই দলে কোনো পদ পেতে না পারেন, সে বিষয়টি নিশ্চিত করার নির্দেশনা দেওয়া হয়েছে। এমনকি সম্মেলন প্রস্তুতি কমিটিতেও বিতর্কিতদের না রাখার কথা বলা হয়েছে। চিঠিতে আগামী ১০ ডিসেম্বরের মধ্যে সাংগঠনিক জেলা ও মহানগরের অধীন সব স্তরে সম্মেলন করে নতুন নেতৃত্ব প্রতিষ্ঠা করার পরামর্শ দেওয়া হয়েছে।</p><p>জানতে চাইলে আওয়ামী লীগের যুগ্ম সাধারণ সম্পাদক মাহবুব উল আলম হানিফ প্রথম আলোকে বলেন, টানা ১১ বছর ক্ষমতায় থাকার কারণে অনেকের বিতর্কিত কর্মকাণ্ডের জন্য দল বিব্রত হচ্ছে। এ জন্য বিতর্কিতদের ব্যাপারে দলীয় প্রধান শেখ হাসিনা খুবই কঠোর অবস্থান নিয়েছেন। দলের কোনো স্তরেই বিতর্কিতরা থাকতে পারবেন না। তৃণমূলের কমিটিতে যাতে বিতর্কিতরা স্থান না পান, সে ব্যাপারে জেলা ও মহানগর নেতাদের তদারক করতে বলা হয়েছে। অন্য দল থেকে আওয়ামী লীগে আসা ব্যক্তিদের বিষয়ে তিনি বলেন, যুদ্ধাপরাধ, সন্ত্রাস ও নাশকতার মামলার আসামিদের আওয়ামী লীগে স্থান হবে না—এই নীতিমালা আগেই নেওয়া আছে। এরপরও কোথাও কোথাও অন্য দলের এমন লোক ঢুকে পড়েছেন, তাঁদের এবার বাদ দেওয়া হবে।</p><p>বিতর্কিতদের কীভাবে চিহ্নিত করা হবে এবং জেলা বা মহানগর কমিটি তাঁদের বাদ দেওয়ার ক্ষমতা রাখে কি না, এ নিয়ে জেলা পর্যায়ের নেতারা কিছুটা দ্বিধান্বিত। তবে কেন্দ্রীয় একাধিক নেতা জানিয়েছেন, জেলা পর্যায়ে সম্মেলন প্রস্তুতি কমিটি বা নতুন কমিটি করার ক্ষেত্রে দলের প্রধান শেখ হাসিনা আগেই বার্তা দিয়ে থাকেন। সে ক্ষেত্রে জেলা নেতাদের অনানুষ্ঠানিকভাবে ব্যক্তি ধরে ধরে বার্তা দেওয়া হবে।</p><p>আওয়ামী লীগের একজন কেন্দ্রীয় নেতা নাম প্রকাশ না করার শর্তে প্রথম আলোকে বলেন, আওয়ামী লীগের বিভিন্ন স্তরে দুর্নীতি ও অনিয়ম এমনভাবে ঢুকে পড়েছে, কোনো ঝড় এলেই দল বিপর্যস্ত হয়ে পড়বে। সম্পদের পাহাড় গড়ে তোলার কারণে নেতা-কর্মীদের মধ্যে অবিশ্বাস প্রকট। ফলে আওয়ামী লীগের শত্রু এখন আওয়ামী লীগই। সব স্তরে শুদ্ধি অভিযান চললে দলই শক্তিশালী হবে। এ জন্যই চলমান অভিযানের বিকল্প নেই।</p><p>গত মাস থেকে শুদ্ধি অভিযান শুরু হয়েছে। জাহাঙ্গীরনগর বিশ্ববিদ্যালয়ের উন্নয়ন প্রকল্প থেকে চাঁদাবাজিসহ নানা অভিযোগে প্রথমে ছাত্রলীগের সভাপতি রেজওয়ানুল হক চৌধুরী ও সাধারণ সম্পাদক গোলাম রাব্বানীকে বাদ দেওয়া হয়।</p><p>এরপর যুবলীগের কেন্দ্রীয় সাংগঠনিক সম্পাদক খালেদ আহমেদ ভূঁইয়া, ঢাকা মহানগর দক্ষিণ শাখার সভাপতি ইসমাইল হোসেন চৌধুরী ওরফে সম্রাট, কথিত যুবলীগ নেতা জি কে শামীমসহ বেশ কয়েকজনকে ক্যাসিনো ও জুয়া-কাণ্ড এবং অবৈধ অর্থ উপার্জনের দায়ে গ্রেপ্তার করা হয়। এসব অনৈতিক কর্মকাণ্ডে সহযোগিতার অভিযোগে যুবলীগ চেয়ারম্যান ওমর ফারুক চৌধুরীকে সাংগঠনিক কর্মকাণ্ড থেকে বাদ দেওয়া হয়। তাঁর বিদেশ যাওয়া নিষেধ, ব্যাংক হিসাবও জব্দ। স্বেচ্ছাসেবক লীগের সভাপতি মোল্লা আবু কাওছার এবং সাধারণ সম্পাদক পঙ্কজ নাথও দায়িত্ব থেকে বাদ পড়েছেন।</p><p>দুর্নীতি দমন কমিশন (দুদক) এরই মধ্যে তিন সাংসদসহ ২৩ জনের বিদেশযাত্রায় নিষেধাজ্ঞা দিয়েছে। পুলিশের বিশেষ শাখার (এসবি) বিশেষ পুলিশ সুপার (ইমিগ্রেশন) বরাবর চিঠি দিয়ে তাঁদের বিদেশযাত্রা ঠেকাতে কার্যকর ব্যবস্থা নিতে অনুরোধ করা হয়েছে। জাতীয় রাজস্ব বোর্ড (এনবিআর) অনেকের ব্যাংক হিসাব জব্দ করেছে।</p><p>আওয়ামী লীগের সভাপতিমণ্ডলীর সদস্য ও ১৪ দলের মুখপাত্র মোহাম্মদ নাসিম প্রথম আলোকে বলেন, টানা ক্ষমতায় থাকার কারণে আওয়ামী লীগের সব স্তরেই অর্থবিত্ত ও অবৈধ ক্ষমতার অধিকারী সৃষ্টি হয়েছে। তাঁদের কারণে ত্যাগী ও পোড় খাওয়া অনেক নেতা-কর্মী দূরে সরে গেছেন। দলের সুনাম নষ্ট হয়েছে, নেতৃত্বে ঘুণ ধরেছে। এখন সুযোগসন্ধানীদের বের করার কাজ শুরু হয়েছে।</p>', 13, NULL, NULL, NULL, NULL, 1, '0', NULL, NULL, NULL, 1, 1, NULL, '2020-02-09 12:22: