(97, 3, NULL, NULL, 'ইতালি প্রবাসী বাংলাদেশি যুবক সাইদুর রহমানের সফল উদ্যোক্তা হওয়ার গল্প', NULL, 1, NULL, '<p>নাম সাইদুর রহমান। ডিগ্রি পাস করে&nbsp;মাস্টার্সে অধ্যায়নরত অবস্থায় প্রবাসে পাড়ি জমান তিনি। সৌদি আরবে কিছুদিন থাকার পর উন্নত জীবনের আশায় ছুটে যান ইউরোপের দেশ ইতালিতে। দু-চোখে স্বপ্ন, বুক ভরা আশা ভালো একটি অফিসিয়াল চাকরি করবেন। কিন্তু স্বপ্ন আর বাস্তবতা যে এক জিনিস নয়, বিস্তর ফারাক এই দুয়ের মাঝে। ইতালিতে যাওয়ার পর সাইদুর রহমানের আর বুঝতে বাকি থাকে না, তিনি যে আশায় ইতালিতে এসেছেন তা এখন মোটেও সম্ভব নয়। তবে তিনি স্বপ্নকে গালা টিপে মেরে ফেলেন নি, মনের মাঝে অতি যত্নে লালন করেছে রেখেছেন। ভাগ্যের নির্মম পরিহাস, যিনি ডিগ্রি পাসের সার্টিফিকেট বহন করে একটি সুন্দর অফিসিয়াল চাকরির আশায় ইতালিতে এসেছেন তাকে এখন ফুটপাতে দোকানদারি&nbsp;করতে হবে!</p>\n\n<p>যখন সাইদুর রহমান বুঝতে পারলেন এখন ফুটপাতে দোকানদারি&nbsp;করা ছাড়া কোনো&nbsp;উপায় নেই। তখন তিনি বিলম্ব না করে ফুটপাতে দোকানদারি&nbsp;শুরু করে দিলেন। তবে বুকের মাঝে কিন্তু স্বপ্নটি এখনো তিনি অতি যত্নে লালন করে যাচ্ছেন। তার বিশ্বাস কেবল তো নতুন আসলাম, কাগজ পত্রগুলো ঠিক হয়ে গেলেই একটি সুন্দর চাকরি পেয়ে যাব।</p>\n\n<p>ইতালির রিমিনি শহরে একটি পর্যটন এলাকায় ফুটপাতে একটি কার্টুনের ওপর মেয়েদের কানের দুল, চুরি, ফিতা ইত্যাদি আইটেম বিক্রি শুরু করলেন তিনি। ফুটপাতে ব্যবসা সাধারণত সব দেশেই নিষিদ্ধ ইতালিতেও। পুলিশ ধাওয়া করলে সব মালামাল কার্টুনে ঢুকিয়ে দৌড় মারতে হয়। এভাবেই চলছে সাইদুর রহমানের ফুটপাতের ব্যবসা।</p>\n\n<p>এভাবে কিছু দিন চলার পর সাইদুর রহমান খেয়াল করলেন তার অদূরেই একজন চীনের নাগরিক কী&nbsp;যেন বিক্রি করে। কিন্তু পুলিশ তাকে ধাওয়া করে না। পরে তিনি খোঁজ নিয়ে জানতে পারলেন চীনা লোকটি এক ধরনের তার দিয়ে হাতে তৈরি পুতুল, ঘোড়া, ঘড়ি ইত্যাদি আইটেম বিক্রি করে। এ ধরনের আইটেম হাতে তৈরি করে বিক্রি করলে পুলিশ কিছু বলে না। সাইদুর রহমান কৌশলে তার পিছু নিলেন এবং কোথা থেকে এই তার ক্রয় করেন এবং সেগুলো তৈরি করেন তা খুঁজে বের করলেন। এক পর্যায়ে তিনিও ওই তার ক্রয় করে পুতুল, ঘড়ি, ঘোড়া ইত্যাদি পণ্য হাতে তৈরি করে বিক্রি শুরু করলেন। এখন তার ফুটপাত ব্যবসা কিছুটা নিরাপদ আগের মতো&nbsp;পুলিশের ধাওয়া খেতে হয় না।</p>\n\n<p>কিছুদিন পর তিনি স্থান পরিবর্তন করে চলে গেলেন সমুদ্র পারে বেচাকেনা তুলনামূলক একটু বেশি। তাই লাভও বেশি। তবে বিচের উত্তপ্ত বালু রোদ বাড়ার সঙ্গে সঙ্গে আরও বেশি উত্তাপ ছাড়তে থাকে। এই উত্তপ্ত বালুর মাঝে হেঁটে হেঁটে পণ্য বিক্র করেন ডিগ্রি পাস সাইদুর রহমান এবং স্বপ্ন দেখেন একটি অফিসিয়াল সুন্দর চাকরির।</p>\n\n<p>এক পর্যায়ে তার কাগজপত্র সব ঠিক হয়ে যায়। এখন তিনি একজন বৈধ প্রবাসী যদিও তিনি বৈধ পথেই এখানে এসেছেন। কিন্তু কাগজপত্র না থাকায় এতদিন ছিলেন অবৈধ। এখন অফিসিয়াল চাকরি পাওয়ার আশাটা মনের মাঝে আরও তীব্র হয়ে ওঠে। তিনি সমুদ্র পাড়ে হকারি করার পাশাপশি বিভিন্ন মাধ্যমে চাকরি খুঁজতে থাকেন। স্বপ্ন, আত্মবিশ্বাস এবং প্রচেষ্টা থাকলে যে মানুষ সফল হন তার প্রমাণ সাইদুর রহমান। এরই মধ্যে একটা সুন্দর চাকরিও পেয়ে যান তিনি।</p>\n\n<p>সাইদুর রহমান এখন মহা খুশি কারণ তার স্বপ্ন সত্য হয়েছে। তপ্ত বালুর মাঝে হকারি করা ছেলে আজ একটি ভালো চাকরি করছে। বেশ কয়েক বছর ভালোই চলছিল তার চাকরি জীবন এর মধ্যে তিনি সন্ধান পান উদ্যোক্তা তৈরির অনলাইন প্লাটফর্ম &lsquo;নিজের বলার মতো&nbsp;একটা গল্প&rsquo;র। প্রথমে তিনি না বুঝেই গ্রুপে জয়েন করেন তখন চলছিল দ্বিতীয় ব্যাচ। ধীরে ধীরে তিনি বুঝতে পারলেন এটি একটি উদ্যোক্তা তৈরির অনলাইন প্লাটফর্ম।</p>\n\n<p>&lsquo;চাকরি করব&nbsp;না চাকরি দিব&rsquo; এই স্লোগানটি তার মনে খুব লেগেছে। দীর্ঘ সাধনার পর যিনি চাকরি পেয়ে ভালোই দিন কাটাচ্ছিলেন তিনি। এক পর্যায় চাকরি ছেড়ে অন্যকে চাকরি দেওয়ার নতুন স্বপ্ন দেখা শুরু করলেন। যেমন ভাবনা, তেমন কাজ। তিনি চাকরির পাশাপাশি সমুদ্র পাড়ে একটি বিচ একসোসারিস (সমুদ্রে গোসলের উপকরণ) এর দোকান দিলেন। তিনি অন্যের চাকরি করলেও নিজে একজনের চাকরির ব্যবস্থা করেছেন এ কথা ভেবে আনন্দ অনূভব করেন। চাকরি এবং ব্যবসা দুটোই চলছে পাশাপাশি। এক পর্যায়ে স্বপ্নের চাকরি ছেড়ে পূর্ণ মনযোগ দেন ব্যবসায়। ব্যবসার পরিধি বৃদ্ধি করতে থাকেন। পাশের আরও একটি দোকান নিয়ে বানান মিনি সুপার মার্কেট। সেখানে আরও কিছু লোকের কর্মসংস্থান তৈরি হয়। এরপর আর পেছন ফিরে তাকাতে হয়নি এই নবীন উদ্যোক্তাকে। অতঃপর হোম ডিস্ট্রিক মাদারীপুরে &lsquo;নাইস অনলাইন শপিং&rsquo; নামে গড়ে তুলেন একটি অনলাইন শপ। মাদারীপুরে ইতঃপূর্বে কোনো&nbsp;অনলাইন শপ ছিল না।</p>\n\n<p>সাইদুর রহমান বলেন, আমার প্রতিষ্ঠানে কিছু লোকের কর্মসংস্থান তৈরি করতে পেরে আমি খুবই আনন্দিত। তিনি ভবিষ্যতে নিজের ব্যবসার সম্প্রসারণের মাধ্যমে আরও অনেক লোকের কর্মসংস্থান তৈরি করতে চান।</p>\n\n<p>তিনি বলেন, &lsquo;স্বপ্ন দেখুন, সাহস করুন, শুরু করুন এবং লেগে থাকুন সাফল্য আসবেই&rsquo; ইকবাল বাহার স্যারের এই কথাটি যদি কেউ মেনে চলেন আমার বিশ্বাস অবশ্যই তিনি একদিন উদ্যোক্তা হবেন।</p>\n\n<p>তিনি আরও বলেন, আমি এই গ্রুপে জয়েন না করলে কখনো উদ্যোক্তা হওয়ার স্বপ্ন দেখতাম না। তাকে শুধু একজন উদ্যোক্তা বললে ভুল হবে। তিনি একজন ভালো মানুষ এবং সমাজ সেবকও। মাদারীপুরের নানা ধরনের সামাজিক কার্যক্রমে সম্পৃক্ত রয়েছেন তিনি।</p>\n\n<p>মাদারীপুর সদর উপজেলার আমিরাবাদ গ্রামের মরহুম মৌলভী মোকসেদুর রহমানের ছেলে সাইদুর রহমান। বর্তমানে তিনি স্বপরিবারে ইতালিতে বসবাস করছেন।</p>', NULL, NULL, NULL, NULL, '2020-03-03 22:31:59', 1, NULL, NULL, 'ইতালি-প্রবাসী-বাংলাদেশি-যুবক-সাইদুর-রহমানের-সফল-উদ্যোক্তা-হওয়ার-গল্প', 'http://api.immigration.orangebd.com/images/LQuLOQNfRx1uJOCj.jpg', 1, 1, '1970-01-01', NULL, '2020-03-03 22:31:59', '2020-03-03 22:44:39'),
(48, 3, NULL, NULL, 'প্রবাসে মো. রইছ এর ভাগ্যবদলের গল্প', NULL, 1, NULL, '<p>নিষ্ঠা, একাগ্রতা আর উচ্চাকাঙ্ক্ষা থাকলে একজন সাধারণ শ্রমিকও যে সাফল্যের চূড়ায় উঠতে পারেন, তার উজ্জ্বল দৃষ্টান্ত মালয়েশিয়া প্রবাসী কুষ্টিয়ার মো. রইছ (৩০)। পরিবার-পরিজন ছেড়ে জন্মভূমি থেকে বহুদূরে দীর্ঘ নয় বছর ধরে কঠোর পরিশ্রম করে নিজেকে সফল একজন মানুষ হিসেবে প্রতিষ্ঠিত করেছেন এই রইছ। আর তার এই সফলতার গল্পে একটা বড় অংশ জুড়ে রয়েছে বাংলাদেশের অন্যতম বৃহৎ শিল্পগোষ্ঠী প্রাণ-আরএফএল গ্রুপের নাম।সম্প্রতি জাগো নিউজের সঙ্গে একান্তে কথা বলেছেন রইছ। শুনিয়েছেন তার সফলতার পথ কতটা বন্ধুর ছিল&nbsp; সে কথা, কঠোর পরিশ্রম করে কীভাবে নিজের ভাগ্যের চাকা তিনি ঘুরিয়েছেন আলাপে উঠে এসেছে তার পরিষ্কার একটা চিত্রও।</p>\n\n<p>কুষ্টিয়ার দৌলতপুরের দীঘলকান্দি গ্রামের আমজাদ হোসেনের ছেলে রইছ ভাগ্য বদলের আশায় ২০০৭ সালে পাড়ি জমান মালয়েশিয়াতে। কলিং ভিসায় মালয়েশিয়া যাওয়ার পর সেদেশের একটি কৃষি কোম্পানিতে&nbsp; মাসিক মাত্র ৬শ রিঙ্গিতে কাজ শুরু করেন তিনি।<br />\n<br />\nজাগো নিউজকে রইছ জানিয়েছেন, এ সময়টা তার জন্য খুবই কষ্টের ছিল। কারণ, প্রথম মাসের বেতন হাতে পাওয়ার পর তিনি কোনোভাবেই হিসাব মেলাতে পারছিলেন না। ওই টাকা দিয়ে তার নিজের চলাই মুশকিল হয়ে যাচ্ছিল। অন্যদিকে দেশের মাটিতে বাবা-মা, ভাই-বোন সবাই তাকিয়ে আছেন রইছের দিকে। রইছের কপালে চিন্তার ভাঁজ পড়ে। ৬শ রিঙ্গিতের মধ্যে নিজের জন্য খরচ করবেন কী, বাঁচাবেন কী আর দেশে পাঠাবেন কী।&nbsp; &nbsp;<br />\n<br />\nরইছ জানান, তিনি যখন এ বিষয়টি নিয়ে দুশ্চিন্তায় দিশেহারা তখন তার সঙ্গে পরিচয় হয় গাজীপুরের মতিন নামে এক এজেন্টের। মতিনের কথা মতো ওই চাকরি ছেড়ে দেন রইছ। যোগ দেন ইপু-তাপা নামক এলাকার আরেকটি কোম্পানিতে, তবে বেতন সেখানেও ওই ৬শ রিঙ্গিতই। &nbsp;<br />\n<br />\nরইছের বিশ্বাস ছিল, কাজে সন্তুষ্ট হয়ে তার বেতন হয়তো বাড়ানো হবে। কিন্তু তেমনটা হলো না। বেতন না বাড়লেও দুশ্চিন্তা বাড়তে থাকলো রইছের। ভেবে কোনো কূলকিনারা করতে পারছিলেন না তিনি। এরইমধ্যে কুমিল্লার শরিফ নামে এক ব্যক্তির সঙ্গে পরিচয় হয় রইছের।</p>\n\n<p>শরিফের কথা মতো রইছের এবারের যাত্রা রাওয়াং-এ। রাওয়াংয়েও তিনি কাজ পান সেই ৬শ রিঙ্গিতেই। এখানে কাজের পাশাপাশি নিজের দক্ষতার দিকে মনোযোগ দেন রইছ। শিখতে শুরু করেন মালয় ভাষা। উপার্জন বাড়াতে সকালে-সন্ধ্যায় অন্য জায়গায় বাড়তি কাজও করতে শুরু করেন তিনি। এভাবে কাজ করে মাস শেষে তার আয় হতো ১৬শ থেকে ১৭শ রিঙ্গিত। এভাবে তিন বছর চলেন তিনি।&nbsp; &nbsp;<br />\n<br />\nরইছ জানান, ২০১১ সালের প্রথম দিকে রাওয়াং-এ তার সঙ্গে পরিচয় হয় প্রাণ কোম্পানির সেলসম্যান জাহাঙ্গীরের সঙ্গে। জাহাঙ্গীর তাকে বলেন, প্রাণে ভালো বেতনে কর্মী নেয়া হচ্ছে। জাহাঙ্গীরের পরামর্শে তিনি পরদিনই প্রাণের অফিসে চলে যান। তার ইন্টারভিউ নেন মাইন উদ্দিন। আকর্ষণীয় বেতনে ভালো একটা চাকরি হয়ে যায় তার।<br />\n<br />\nমূলত এখান থেকেই রইছের ভাগ্যবদলের গল্প শুরু। মাসিক ১১শ রিঙ্গিতে কাজের পাশাপাশি প্রাণের সিনিয়র সেলসম্যান আখতারের সঙ্গে চারটি ট্রেইনিং সম্পন্ন করেন তিনি। রইছের কাজের দক্ষতা দেখে তার মধ্যে সম্ভাবনা দেখেন প্রাণের জেড এম মোশাররাফ হোসেন। প্রতিষ্ঠানের ক্যাটালগের প্রাইস লিস্ট দিয়ে রইছকে তিনি পাঠিয়ে দেন বান্তিং (এল এইচ এস মাজু ট্রেডিং) ডিলার পয়েন্টে। সেখানে তিন মাস কাজ করার পর রইছ চলে আসেন প্রাণের হেড অফিসে।<br />\n<br />\nরইছ জানান, মাঝে একটু দ্বিধা থাকলেও একসময় তিনি সিদ্ধান্ত নেন যা হওয়ার হবে, প্রাণের চাকরি তিনি ছাড়বেন না। সময়ের ব্যবধানে রইছের সেই সিদ্ধান্ত সঠিক প্রমাণিত হয়েছে। বর্তমানে তিনি জোনাল ম্যানেজারের দায়িত্ব পালন করছেন।<br />\n<br />\nরইছ বলেন, প্রাণ আমার ভবিষ্যৎ। বর্তমানে সাড়ে ৪ হাজার রিঙ্গিত বেতন পাচ্ছি। ২০১৪ সালে কাজের দক্ষতার পুরস্কার হিসেবে একটি গাড়ি পেয়েছি, বাড়ি ভাড়া ফ্রি।</p>\n\n<p>চাকরি করে ২০ লাখ টাকা খরচ করে ১ তলা একটি বাড়িও করে ফেলেছেন রইছ।<br />\n<br />\nরইছের একমাত্র ছেলের বয়স ১২, নাম অমিত হাসান। এছাড়া তার তিন ভাই ও তিন বোন রয়েছে। ছোট ভাই সোহানুর রহমান ঢাকা তিতুমির কলেজে লেখাপড়া করছেন। সোহানের লেখাপড়ার খরচও বহন করছেন রইছ।</p>\n\n<p>তার মতে, নিজে এইচএসসি পাস করে আর পড়ালেখা করতে পারেননি, তাই ছোটভাইকে সুশিক্ষায় শিক্ষিত করে তুলতে পারলে বাবা-মা খুশি হবেন। রইছের মতে, বাংলাদেশিরা কাজে দক্ষ, পরিশ্রমী এবং সৎ।<br />\n&nbsp;<br />\nরইছ জাগো নিউজকে বলেন, প্রাণের পণ্যের বড় বাজার এখন মালয়েশিয়ার ৯টি প্রদেশ। সেখানকার কয়েকশ শপিং সেন্টার ও গ্রোসারি শপে প্রাণের পণ্য পাওয়া যাচ্ছে। মাত্র কয়েক বছরের মধ্যেই মালয়েশিয়ার অন্যতম ব্র্যান্ডের খেতাব অর্জন করেছে প্রাণ।<br />\n<br />\nকুয়ালালামপুরের কুতারায়া বাংলা মার্কেটসহ মালয়েশিয়ার বিভিন্ন প্রদেশে বসবাসকারী প্রবাসী বাংলাদেশিরা প্রাণের পণ্যের মাঝেই খুঁজে পান মাতৃভূমি বাংলাদেশকে। স্থানীয় মালয় ও ভারতীয় বংশোদ্ভূত মালয়েশিয়ানদের কাছেও প্রাণ একটি জনপ্রিয় ব্র্যান্ড।</p>', NULL, NULL, NULL, NULL, '2020-02-10 17:43:39', 1, NULL, NULL, 'প্রবাসে-মো.-রইছ-এর-ভাগ্যবদলের-গল্প', 'http://api.immigration.orangebd.com/images/OtGrBI4lTcPsQWJ0.png', 1, 1, '1970-01-01', NULL, '2020-02-10 17:43:39', '2020-03-05 23:20:56'),
