(54, 4, NULL, NULL, 'প্রবাসে করণীয়', NULL, 1, NULL, '<h2><strong>আপনি যে দেশে চাকরী করতে গিয়েছিলন, সে দেশ থেকে নতুন কোন গম্ভব্য দেশে বাওয়ার ক্ষেত্রে করণীর:</strong></h2>\n\n<p><img alt=\"\" src=\"https://photos.google.com/share/AF1QipOYWlvlahP-ZPM_SZ60eYqnTP21qp163d9dXKbqP7j78-6snJMRVCn1PVJ2s9XE0w/photo/AF1QipN_T60tJQBTjMZirY-eyiYeA5SfDJy2ndKBjjR7?key=RnhpRFJxSzdNQmRhQWJ0Y0Fmbmw5M09rTUM5TlNn\" /><img alt=\"\" src=\"https://lh3.googleusercontent.com/ZOUXZUi7G67jTvgWHKVk6-Y9686ltliMHJreG6Hxh2IH4RzV3Q_tZa6nIqrTKcEJReL2VoTUFCoPqz_dwgeR2w9jfl-JfxBIc1fMe4Xzc30iX9zb0I_aViXlGs3aJU3rIRo12wEjTeGg64PRR9vQbhIi6Zyt-T38_QMKW4BLD0bpeqx1KVJMROFRYGDR8YGYfaPi7lo1oRwhaLkBcjVrZnhaJQqDgEZZzkcvNbEmMNnkJFxAv_0ypofb5271nxiSIku3RpLn4WSjSjxS7SecJAcvCS_nYH107PGrp6cl5S19mtPdFK_rze5kZiDBCZZRnwqVdA_RCst5MB25VIZpVoLnX44harQEcIf6oDWZCm5n6lLBYKNJz_1r33R_e_yWGgO9xStGGph2DSc12GQcdvz2fiy--JGzEpaJNeYKcNc7nN5PDOn_1vnCK7txrq3HhsaMukaRpG8YH39TcJpIme7ONFc1hThEQnEC2Uya7j_3OCuVCJsbxUReYZFJg4VIvK1BGEYSAtoq3RtD7FlclZpcB1OGogMejGF8ZAQ6nBijaWpG9JToh4508NVAGBbC6sqSxcfBmF6w3tXm4FCvVL03pFvU37v2t9IfEclsejS7GgnbucTX2HDcMl6lgev9AcnXe6BrLdnVI7uoZqZtaSb5C_ySjPrdA8SswtQvdPu-SDzkwAAONw=w971-h654-no\" style=\"height:471px; width:700px\" /></p>\n\n<ul>\n	<li>নতুন দেশে চাকরীর প্রস্তাব পেলে যাচাই না করে সিদ্ধান্ত নিবেন না। যে দেশে অবস্থান করছেন, সেই দেশ থেকে তৃতীয় কোন দেশে সরকারি চাকরী করতে জাওয়া যায়না। এক্ষেত্রে আপনাকে সর্বপ্রথম বাংলাদেশে ফেরত আসতে হবে এবং এ দেশ থেকে সরকার অনুমদিত পন্থা অবলম্বন করে বিদেশ যাওয়ার জন্য প্রয়োজনীয় কগজ পত্রের ব্যাবস্থা করতে হবে।</li>\n	<li>নতুন গন্তব্য দেশ এবং প্রস্তাবিত চাকরী সম্পর্কে ভালভাবে খোঁজ নিন। চাকরীদাতা&nbsp;সম্পর্কে প্রয়জনিও তথ্য জানুন&nbsp; ।</li>\n	<li>প্রস্তাবিত চাকরীর জন্য আপনার প্রয়ােজনীয় প্রশিক্ষণ আছে কিনা তা ভেবে দেখুন এবং সকরর চুক্তিপত্র (কন্ট্রাক্ট) বুঝে নিন।</li>\n</ul>\n\n<ul>\n	<li>বৈধ ভিসা বাংলাদেশে অবস্থতি সংশ্লিষ্ট গন্তব্য দেশের দূতাবাস থেকে সংগ্রহ করুন।</li>\n	<li>সমুদ্র অথবা নদী পথে এক দেশ থেকে অন্য দেশে যাত্রা করা থেকে সর্বদা বিরত থাকুন। এপথে আপনি চোরাচালানের শিকার হতে পারেন। এমনকি মারাও যেতে পারেন।</li>\n</ul>\n\n<p><strong>মনে রাখবেন :</strong></p>\n\n<ul>\n	<li>চাকরীর জন্য &nbsp;বাংলাদেশ ছেড়ে অন্য যে দেশে অবস্থান করছেন, সেই দেশ থেকে সরাসর তৃতীয় কোন দেশে বৈধভাবে চাকরী করতে যেতে পারবেন না। যতবারই আপনি চাকরার জন্য বিদেশ যেতে চান কিংবা অবস্থানরত দেশে থেকে নতুন কোন দেশে চাকরী করতে যেতে চান, ততবারই আপনাকে বাংলাদেশ ফেরত এসে দেশে অবস্থিত সংশ্লিষ্ট দেশের দূতাবান থেকে ভিসা সংগ্রহ করতে হবে।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p><strong>গন্তব্য দেশে পৌঁছানোর পর</strong></p>\n\n<p><strong><img alt=\"\" src=\"https://lh3.googleusercontent.com/iDStvwVeK9l8GipKykKHFByxorx2G-6jq_FL4Bouuzgyyo-jW6lS0gkm-id-D6kNJikvAE1iMEZsVMr6gG2_mh9FCFWOyelQM9VQ7CKpDzuZGIbMmH-xiwJX9PI59hlSztMcOJgNBL4Qcg9kH6eedSo1wr8FjAwEOrM5lTmwljUWH5wR6qmWNFVgfa_97CmgjLVzEQLUVk5Xo6ptH6dcLGfD2lG_NR8QwyR-4a9EQwuZch4svO9OT1gMqnVHry1NxGfwaaSpDnozVWeW88Af9ap-8hOB5ulUtXn6uWmxJR2D3toUBC3mvVGUYKdcBLq2Bs_bWDOZQ1uFjnkR_ODUBYtBI9O-qSw50E2Y5BkI5vPQxRprdGi495U2TVrjv4SfeGAeWoXSMbboLJZxdNbTZ-WAJg7Cvm1VmGjIzl3EDMx92bkQntdNBVobxy81JtdLdZyeaFLv6ENDX7_S9QiD2Z5fmj0bU2AB0yMDYg1IkXUDV26D3Oa1Z57n90tqjwBZ7_r3n61AeH9GkTKnNr21dkzF4YBQysEjee7cubyVK4HwzXxs9CaWDCZPX1bhd0fnOLMPVH-bC6e1ERmZNu9EeKiTVaKqx_xGS6smV0yMkeMXu6tj00NFfUTzuaSfzcJdrR3vvNIsynv76Srnd5ZP3HAj2BiLB1EcFlcIzxlH4Aq3w1910uG7t6CErGmI-xAw19Ptoj2OUoAR8H6VoVNVpD-XDZuPGnn-sxmmV3D2YRD6b2I=w857-h654-no\" style=\"height:534px; width:700px\" /></strong></p>\n\n<ul>\n	<li>বিমান বালার নির্দেশনা অনুযায়ী আপনি প্লেন থেকে নামবেন ;</li>\n	<li>আপনাকে অবশ্যই নিশ্চিত হতে হবে এটি কি ট্রানজিট না আপনার গন্তব্য দেশ। নিশ্চিত হবার পর আপনি নামার প্রস্তুতি নিবেন। আপনি যদি না জানেন প্রশ্ন করে জেনে নিন। এটা যদি আপনার গন্তব্য দেশ হয় তবে প্লেনে আপনাকে দেয়া। ডিমার্কেশন/অবতরণ ফর্মটি পূরণ করে বহির্গমন ইমিগ্রেশন কাউন্টারে যাবেন;</li>\n	<li>ইমিগ্রেশন কর্মকর্তাকে আপনার পাসপোর্ট দেখাতে হবে। আপনাকে ঐদেশে প্রবেশের অনুমতি দিয়ে আপনার পাসপোর্টে একটি সিল দেয়া হবে। এই সিলে আপনি যে তারিখে গন্তব্য দেশে পৌছেছেন তা লেখা থাকবে। সতর্কতার সাথে তারিখটি ঠিক আছে কিনা পরীক্ষা করে নিবেন।</li>\n	<li>ব্যাগ সংগ্রহের স্থানটি খুঁজে বের করে আপনি বিমানবন্দর কর্মকর্তাদের ব্যাগের ট্যাগটির সাথে টিকিটে আটকানো ট্যাগটি মিলিয়ে নিতে দিবেন ও ব্যাগ সংগ্রহ করবেন ।</li>\n</ul>\n\n<p>আপনার কোম্পানী থেকে নিযুক্ত ব্যক্তির সাথে বা তার নির্দেশনা অনুযায়ী আপনি বিমানবন্দর থেকে বের হবেন এবং আপনার</p>\n\n<p>কোম্পানীতে যাবেন।</p>', NULL, NULL, NULL, NULL, '2020-02-11 15:20:13', 1, NULL, NULL, 'প্রবাসে-করণীয়', NULL, 1, 1, '1970-01-01', NULL, '2020-02-11 15:20:13', '2020-03-04 20:10:33');
