(55, 4, NULL, NULL, 'বিদেশ যাত্রার প্রস্তুতি', NULL, 1, NULL, '<h2><strong>বোর্ডিং এর সময় এবং প্লেনের ভিতর :</strong></h2>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/VZZHbeI3U5fQPJTrahV-Tck0clkuSOhdOQpwYFzMraiGs6fMtcp81-LPDhv9DEFbcUxDd5FeuOx0NVxCZiJmA342KBceEmmeSPfsIwCf2Z3YtqSLl06ewEUV8I3TJzeYkxriPwaXOIRCWnRfqv0N2qw_3ERoIBJAvKrNoPh1ZRmJ-fnRci0THL7Doh0bFzXGjDP07GGDyDCGM0pqBimy5SiMGBh4_IzDkmmrSd0KVrMkWWmTBbfKv3k-pSclxhVh6JTPA__9_nFExuynLq_ERVEbkcASnkBlkSK07ogmRrS9aez_cWDHPpTYEY063hlZWD247ud4h-DBznDCgYOvrhsBDOaEpkreAQu30G-cRU-l-ZpDWeGk0ehrn6q7McEV3dAkTPtekkIjAroQcxZ-0vmv300AizGB5G0LzHUcQrf44P5Y4nR4BmREfXLGmy1U53ISrfORxnZvFj26nUnKlmxDn7anSMa-rAIjnc3zuSRMe5u6M9C_iXobXASJO5nZCEEU79ny4DdU4nR3yMbXibS3nkyxcvxP6uU0Yxzba3r2xrrpHqD018sf09-i6f3zBGci2tpQf2MYeHK7x8Yp8fn90FxzdsPyeQGG6PcB4iYIjcKETv2ghyA34o309GLbmS9DjZK-_X3raM3NQutZ8kd-9uRXgCg_HQ25R0upYfunLvDNpilwq-LuyUsRWcG1jUMV9kiFbBaCIw1H4CDsHGbGJ1rygqzoC-yVfzTn4MvV0f4=w882-h654-no\" style=\"height:556px; width:750px\" /></p>\n\n<h3><strong>বোর্ডিং পাস গ্রহন</strong></h3>\n\n<ul>\n	<li>প্লেনের টিকিটের গায়ে যে বিমান কোমপানীর নাম লেখা থাকবে তার কাউন্টার খুঁজে বের করতে হবে, আপনি ঐ কাউন্টারে ট্রেনের টিকিট ও পাসপোর্ট জমা দিন।</li>\n	<li>তারপর আপনি আপনার বড় ব্যাগ/সুটকেস বিমান কোম্পানীর কাউন্টারে জমা দিবেন এবং গন্তব্য দেশে পৌছে তা গ্রহণ করবেন।</li>\n	<li>টিকিট চেকিং কাউন্টার়ে ব্যাগ জমা দিয়ে টাগ সগ্রহ করুন এবং কোন অবস্থাতে ট্যাগটি হারাবেন না। একই কাউন্টার থেকে বোর্ডিং পাস সংগ্রহ করুন;</li>\n</ul>\n\n<p>বোর্ডিং পাসে যে গেট দিয়ে প্লেনে উঠবেন, প্লেনে ভিতরের সিট নম্বর এবং প্লেনের নম্বর লেখা থাকে। বোর্ডিং পাসটি ছেট</p>\n\n<p>একটি কাগজ এটি পাওয়ার পর থেকে গণ্তবা দেশের বিমানবন্দর দিয়ে বের হওয়ার আগ পর্যন্ত এটিকে খুব যত্ন করে সংরক্ষণ।</p>\n\n<p>&nbsp;</p>\n\n<h3><strong>প্লেনে ওঠের আগে সতর্কতামূলক তথ্য :</strong></h3>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/zk_LSy19d3gsvPIRAVoJfQHommD2uQOE0kx6WjLFQPexFLbsWHIt28dEju_KpoeI_g9-tsf9q8K-vNoiDprzRTE1Ph38kOFjeuvNCoI1CvHpy8FjnP5ATcKkOxrKXz9103OpRty3ImMRcwmaf5zFX6ZbQ7L1A9FSEUIFhGxGqoS5OGqS8H3aLjxxt-23421KWbyoi1k156KueLSL0muvArmm3quq0k4lpk0p3b8ZDl95TCNFDuiWEiFNbkNxlwI61DvacRrfYzmMAd8a0bbUehiFx3EqDRUoWkOE_DqGXx7at-w9xMKmvSyJdl-ie_r70l-wjMpmSQ_rYaZrDfbt5jg0JiVadQW0EQJ8hYBhFTlZeOz0Ve7Xb9VhEmoRS9Lke84B2nyMVujcMuNhTXu0h0FiCNNhDWr_vfLxiFWmd32cRjsnbV3SlFpEge9O5OUDHysBQrCehsaMHunn0SC4Bo-AxHWgqQPUybERxfF3zlmVYiBlLeqM4O87aT_tRWXPi4w6EVOvCu3FSViqyAx9861tuCaMPBkBP5xN23ycnuvXTEkpntI2GjoKu4aIDq8GU7jQ44v0Dbvw8dQe1ep2w6Kgx42qk4jDx3LvT16EvasWuA4io_oBvBcuD0XqDDPIsWR3q4NOptp7oxH9rnbNdTwwySru7-jVygBvZ-LOBjeXgjISOCSDz4Q9kzT_f095shjv0MNDwxwtO4vOgMWVLIBR4WlVkglxFUH6JkpcnKdtz3I=w856-h654-no\" style=\"height:573px; width:750px\" /></p>\n\n<ul>\n	<li>পরীক্ষা করে দেখুন আপনার সাথে পাসপোর্ট, ভিসা, টিকিট, চাকুরীয় চুক্তিপত্র, স্মার্টকার্ড, প্রশিক্ষণ এবং স্বাস্থ্য পরীক্ষার সনদ আছে কি না ।</li>\n	<li>প্রয়জনীয় কাগজপত্র বোর্ডিং পাস এবং প্লেনের টিকিট সাবধানে রাখুন।</li>\n	<li>গন্তব্য দেশের বিমানবন্দরে যে আপনাকে নিতে আসবে তার নাম, টেলিফোন নম্বর এবং ঠিকানা সাথে রাখুন।</li>\n</ul>\n\n<h3><strong>প্লেনে বোর্ডিং এর সময় এবং প্লেনের ভিতরে করণীয়</strong></h3>\n\n<ul>\n	<li>আপনার টিকিটে উল্লেখিত ফ্লাইট না শােষণ করা হলে আপনি বিমানের দিকে যাত্রা শুরু করবেন। আপনার বোর্ডিং পাসে গেট নম্বর এবং প্লেনের সিট নম্বর উল্লেখ থাকবে। বিমানবন্দরের টিভির পর্দায় এই তথ্যগুলো দেখানো হয়।</li>\n</ul>\n\n<ul>\n	<li>বিমানবালারা প্লেনের প্রবেশ মুখে পাড়িয়ে গাকবে। আপনি তাদেরকে বোর্ডিং পাস দেখিয়ে সিট সংক্রান্ত তথ্য নিতে পারবেন।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>প্লেনের ভিতরের জন্য সতর্কতামূলক তথ্য</strong></h3>\n\n<ul>\n	<li>প্লেনের ভিতরে ধূমপান সম্পূর্ণ নিষেধ</li>\n	<li>আপনার সাথে যদি মোবাইল ফোন থাকে তবে তার সুইচ অফ করুন;</li>\n	<li>কিছুক্ষণ পরপর যে ঘোষণাগুলো করা হবে তা মনোযোগ দিয়ে শুনুন;</li>\n	<li>আপনার সাথে হাতব্যাগ থাকলে তা আপনার সিটের উপরের বক্সে রাখুন;</li>\n	<li>কোন সমস্যার সম্মুখীন হলে বিমানবালাকে জানান:</li>\n	<li>দুরের যাত্রার ক্ষেত্রে প্লেনের ভিতরে সকালের নাস্তা, দুপুরের খবার এবং রাতের খাবার বিনামূল্যে পরিবেশন করা হয় আবে বিমান কোম্পানীর ক্ষেত্রে আপনাকে খাবার কিনে খেতে হবে। টিকিট কেনার সময় এই বিষয়টি নিশ্চিত হয়ে নিবেন।</li>\n</ul>\n\n<p>প্লেনের ভিতরে বাথরুমর ব্যবস্থা রয়েছে এবং এটার দরজার ইংরেজিতে &#39;Lavatory&#39; লেখা থাকে । দরজায় লাল রং এর Occupy লেখা থকলে বুঝতে হাবে বাণরুমের ভিতরে লোক আছে। সরজায় সবুজ বুং, অথবা Empty লেখা হবে বাথরুমটি খালি আছে। আপনি যদি না জানেন কিভাবে বাথরুমের দরজা খুলতে হয় বন্ধ করতে হয় বা বাথরুম ব্যবহার করতে হয় তাহলে বিমাননালাকে প্রশ্ন করে জেনে নিন। বাগরমের মেঝে পানি দিয়ে ভেজানো উচিত নয়।</p>\n\n<h3><strong>প্রবাসী কল্যাণ ডেস্ক</strong></h3>\n\n<ul>\n	<li>আপনার ব্যাগ জমা দেয়া এবং বোর্ডিং পাস পাওয়ার পর আপনাকে প্রবাসী কল্যাণ ডেস্তে গিয়ে কাজের অনুমতিপত্র এবং স্মার্ট কার্ড দেখাতে হবে। আঙ্গুলের ছাপ ও ছবির সাথে মিলিয়ে এখানকার কর্মকর্তা আপনার একেশন কার্ডে সিল দিয়ে দিবেন। এই ডেঙ্কে গন্ভবা দেশ সম্পর্কিত বিভিন্ন তথ্য সম্বলিত কাগজপত্রও থাকে।</li>\n</ul>\n\n<h3><strong>এম্বার্কেশন কার্ড/আরোহণ কার্ড</strong></h3>\n\n<ul>\n	<li>বাংলাদেশ সরকারের কাছে তথ্য দেবার জন্য আপনাকে এম্বার্কেশন কার্ডআরােহণ কার্ড পূরণ করতে হবে,</li>\n	<li>এআপনি ফ্মটিতে গন্ভব্য দেশের নাম, বিদেশে যাওয়ার উদ্দেশ্য, আপনার নাম, স্থায়ী ঠিকানা, পাসপোর্টের বিন্তারিত তথ্য, প্লেনের নম্বর ইত্যাদি তথ্য লিখবেন এবং ইমিগ্রেশন ডেস্কে ফর্মটি জমা দিবেন। আপনি যদি তথ্যগুলো পূরণ করতে সমস্যরি সম্মুখীনহন তাহলে প্রবাসী কল্যাণ ব্যাংকের সাহায্য নিন।</li>\n	<li>বহিগমন বা ইমিগ্রেশন চেক ইন করুন</li>\n	<li>এম্বেরকেশন কার্ডের সাথে অন্যান্য গুরুত্বপূর্ণ কাগয়াপর, যেমন- পাসপোর্ট, ভিসা, চাকুরীর চুক্তিপত্র, বোর্ডিং পাস ইত্যাদিও কাউন্টারে জমা দিন।</li>\n</ul>\n\n<h3><strong>বিমানবন্দরের ভিতরে :</strong></h3>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/14HiEpiXt25wmoSOtPCY2kFwtDnxIx_APoJq8_NQPOa4o7ZEAMuHQF1ILZKloRLWT5cu3N2yzaJspiwNrHoMfNCQb8ngc6bowgIcoLA15CjcR8nnWhPtvu0B01z1b0v-Bp-QCAxelCS43rYfTr-8m73IT6YD0cm5VfJjK-bqwDzsde5cQe2jSAmoif9Q6Aj1nAHS2xIfzQqyJloTl0GXUmkcDSGSHbrksA0aj6qN8zBngjYScBogpCDx87FjmQdPs0ZkH5d4ZpQRe-eHjGzd_mlY3gmW69hpJxvb0Z0Kk_qbFYfVCLVxae5SZmewc0P3E5e2vUGYzeUoGyHmO1i8zk5JGqQHYQBA5TgQNeUhXvrgnBvjBi9sHJjnBw1fKF9tMKhAGw7raBzV53lUCIHlt5mt5nH1nRbRUZUva-wqcxCAeqAS1e4uYuH9QmBE1mZVtyG4UUs_4jAosBb9L5Jd1LQm3nU45r1a6fiekJ5zvoSqEQSAm8dtJa2rjEAvLFJoKPBN8dFgogR9B0u73-BfcSSVx40GFXT8fTNY1-bG15lfhs_19x4JvwG2U_ciOfBN0BAe04Hp10A3kplV5lG-_X0hk7Qb7eAgnpUJIQ8zL-wlsm_k-1D9KCJws1dQGXFQytC8hK7H4DZh-ZY4DFBXWgG5UlRL5XWluQ0kPIFKF9cV9fhy4uPnqSMdd6ApM26ij1mmhEFmXMI3hBuSpkDXRHqekHFkI-BVllVSomnPSQXYEyM=w986-h654-no\" style=\"height:498px; width:750px\" /></p>\n\n<h3><strong>বিমানবন্দরে প্রবেশ</strong></h3>\n\n<ul>\n	<li>বিমানবন্দরে চুকতে হলে বশ্যই আপনাকে পাসপোর্ট ও প্লেনের টিকিট দেখাতে হবে,</li>\n	<li>বিমানবন্দরের টিভিতে প্রেম কখন ছাড়বে সে সম্পর্কিত তথ্য দেখানো হয় এবং আপনাকে সে সময় মন্ত্রীপসশােরট ও প্রেনের টিকিট দেখিয়ে গেট দিয়ে ঢুকতে হবে:</li>\n	<li>আপনি ডেতররে ডুকে হল কমে পৌছলে বিভিন্ন এয়ারলাইন্দের কাউন্টার সেখতে পাবেন।</li>\n	<li>আপনি একটি নিরাপত্তা তল্লাশীর কাউন্টার দেখতে পাবেন। অবশ্যই লাইনে দাড়ালেন এবং বৈদ্যুতিক ক (এস্কনিং) আপনার ব্যাগগুলো দিবেন, নিরাপত্তা রক্ষী আপনাকেও পরীক্ষা করবে।</li>\n	<li>চেকিং এর পর আপনি আপনার ব্যাগসহ যে প্লেন কোম্পানীয প্লেনের টিকিট কিনেছেন ভার কাউন্টারে যাবেন।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>বিমানবন্দরের ভিতরের জন্য সতর্কতামূলক তথ্য:</strong></h3>\n\n<ul>\n	<li>ফ্ল্যাইটের সময়, ফাইটো ভারি, যে দেশে যাচ্ছেন সে দেশে পৌদানোর সময় এবং ফ্রাইটের নম্বর প্রেনের টিকিটে লেখা থাকে</li>\n	<li>আপনি যখন প্লেনের টিকিট কিনেছেন, টিকিটের সাথে বিমানবন্দরের ট্যাক্স দেয়া হয়েছে, আপনাকে আর বিমানবন্দর ট্যাক্স দিতে হবে না;</li>\n	<li>বিমানবন্দরে আগনার ব্যাগ বহনের জন্য ট্রলির ব্যবস্থা রয়েছে। এটি ব্যবহার করতে টাকা লাগেনা। আপনি অবশ্যই আপনার প্রয়োজনীয় কাগজপত্র হাত ব্যাগে রাখবেন। ধারালো অস্ত্র, যেমন- ব্রেড, ভুরি ও অন্যান্য নিছি জিনিস সাথে বহন করবেন না।প্রয়োজনীয় জিনিসগুলো ব্যাগে রাখুন;</li>\n	<li>যদি পাসপার্ট বা অন্যান্য গুরুত্বপূর্ণ কাগজপত্র হারিয়ে যায়, আপনি অবশ্যই সাথে সাথে বিমানবন্দর কর্তৃপক্ষ এবং সিকিউরিটি সংস্থাকে জানাবেন:</li>\n	<li>বিমানবন্দরের ভেতরেই বাথরুম, টেলিফোন, প্রয়ােজনীয় জিনিস ও খাবারের দোকান রয়েছে;</li>\n	<li>বিমানবন্দরের ভিতরে কম্পিউটারের মাধ্যমে বিভিন্ন বিমান কোম্পানীর প্লেন পৌছানাে এবং ছেড়ে যাওয়ার তথ্য টিভি স্ক্রিনে দেখানোর ব্যবস্থা আছে।</li>\n</ul>\n\n<h3><strong>বিমানের টিকিট ক্রয় :</strong></h3>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/oVBbK3cjoDJWZ1IVyfwP73b4qJfm-kiaib6xdPix4BH3Yxtg1WPF9TXfsnJiWAgGepkK0XHqJyJfRvL-ZEobUEh0-YtYbKhwRg3EUpAgZ0_K-G5udCAXtN-WheHLNm_eqx1ODOXaX6CFmnyb9xLuUKGH7moKEHSvQk8_nCC--qZdWH1M4Zjts0C1STDUXDb0cbFl0rlmwGpGp92a75tlPg1sHjcj-eNK_XozBakrgwYhTkDNKjP1liFR_cWOAOkmxEw0cE0uGuCTQEcsA_WwqQU0jVT6ZMpNFsyihcE0LNOu-H0xgQtwJ8k3Z_LhSr7aNgfXvcYlLMwYesaMiG292DviAKydJtT3-X412LC7bfx2lAkNxJKF2zBSQ8dHANjJG5QR0DUpgFHtfNw5Ig0rfs-9dqjFqfE4FbFMYa2_ubOCsBPGbDWSBrmVqtemWvQHd0iOJtl-wBsFO7vt5J3nGDeqXHcZtE5rF49uhWkHk8xCk780iwWpJHSaCP0MVDVDqZvzHNupxVLGYBg3HBOQfTpzwZEWKhMF0nv-hRacKViJQoxFT7RkHuOJzO8mzJgcAtXTCViO10397D7HhhSJ8bXD-qDiSR35i2ZKT5Mxob6FeCIlY5_RNfV5VyTqKPKSuC91oTC4LDv-knLca0_G7UmGf2atAVkQQEsGMSlkHKtaQo64sNmZIBTvObU72fO9YwnGV6jbhJa5ncxpRyBrVGoXLGTnt9nfcyHMlI-f9OyS460=w762-h654-no\" style=\"height:645px; width:750px\" /></p>\n\n<ul>\n	<li>বিদেশে কাজ করতে যেতে চাইলে আপনাকে আন্তর্জাতিক বিমান সংস্থা থেকে টিকিট কিনতে হবে</li>\n	<li>আমাকে অবশ্যই নিজ দেশের বিমানবন্দর ব্যবহার করতে হবে (হযরত শাহ জালাল আন্তর্জাতিক বিমানবন্দর, ঢাকা শাহ আমানত আন্তর্জাতিক বিমানবন্দর, চট্টগ্রাম; ওসমানী আন্তর্জাতিক বিমানবন্দর, সিলেট) ।</li>\n	<li>টিকিটে প্লেন ছাড়ার যে সময় লেখা থাকবে আপনাকে অবশ্যই তার ৩ ঘণ্টা আগে বিমানবন্দরে উপস্থিত থাকতে হবে।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>বিদেশে কাজ করতে যাওয়ার সময় যে কাগজপত্র আপনার সাথে রাখতে হবে</strong></h3>\n\n<ul>\n	<li>পাসপোর্ট ভিসা ও স্বাস্থ্য পরীক্ষার মূল সনদ, প্রশিক্ষণের সনদ (যদি থাকে), চাকুরীর চুক্তিপত্র, কাজের অনুমতিপত্র, স্মার্টকার্ড এবং প্লেনের টিকিট</li>\n	<li>কোম্পানীর নাম, ঠিকানা, গন্তব্য দেশে পৌছে কোম্পানীর যার সাথে যােগাযোগ করবেন তার নাম ও ফোন নম্বর:</li>\n	<li>গন্তব্য দেশে বাংলাদেশী দুতাবাসের ঠিকানা ও ফোন নম্বর অবশ্যই সাথে রাখতে হবে</li>\n	<li>প্রবসী বাংলাদেশীদের বিভিন্ন সংগঠনের ঠিকানা ও ফোন নম্বর (সম্ভব হলে) সাথে রাখতে হবে,</li>\n	<li>অভিবাসী কর্মীদের সহায়তা করে এমন সংগঠনের নাম ঠিকানা ও ফোন নম্বর এবং ঐ সংগঠনের যায় সাথে যোগাযোগ করতে হবে তার নাম:</li>\n	<li>তাৎক্ষনিক প্রয়োজনের জন্য উলের বা গন্তব্য দেশের মুদ্রা সাথে রাখতে হবে।</li>\n	<li>প্রত্যেকটি কাগজপত্রের কমপক্ষে এক সেট ফটোকাপ আপনার নিজের কাছে রাখতে হবে এবং এক সেট ফটোকপি আপনার পরিবারের সদস্যদের কাছে রেখে যেতে হবে।</li>\n</ul>\n\n<h3><strong>বিদেশে পূবে প্রাক-অভিবাসন ব্রিফিং :</strong></h3>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/-lB_YQkFgY-ZAy9ryH0PP2mCbGxAMS7CtfGeyaSvrQESSwhZSWYmUP0ihhYgfa71xJLs8xr63M186kkYckYJ5BSv7-KfwN0YWSdx3mocFiKQBbzwzDkvxYbadvcELCJGo7h6KlKBtsvvSopUCU4WGT2u6s84jf921LyjWAMGGOKkpv1ELRXYiwjaN_DA8FyIILRQQKnE8f9lCAMIsM64i-2iLFhLWqz3VsggllEFmOKJbwdNeCamjuZ5V1WIS1C4X7R0VhPoH4Y-iEAOsaPhztm2Alp-GOE0SR8QSFKvV5Z5rJg7z1m4Y7atWfkZc7QW63Lm7WgR7BofVC1T_tnpdXxYe9azLqforILTlumcpeQK-ZQz4W-XjIPXnZXoGAwmccvrbcr8nSVbTFUwFiwII0pQO0rB80Z6_d-3hQPocuzVUg6OscmOn0yEPjF3ThIwMUTgHnxGS67TnHPzWYGyf5MvZFW8Sv-93QQxxeKiiYlo_d_pQ-tfMV-2AleFWciuSE_pPbFwAVBSHe0bLcI1pLB0aMwRte29bDGVkymqUlxoRYvqV2_ZD_Mv5pBpbmL-AEtgGe9m8BxAIJszafMI87fCU-J6kSVLwLoIyRFQ4wKlmey0MTHszUmRrov3nIKrZRX2jxW7uYPYu5lNbwLPqWoslVMxU6esky5RwapA6IXfn54nZkKfgULxCTi39J9a8gb9w7XqM_IubbULppedxLJxQA1QsxORMSesnrekxBadtqE=w661-h654-no\" style=\"height:742px; width:750px\" /></p>\n\n<ul>\n	<li>বিদেশে চাকুরী করতে যাওয়ার জন্য প্রত্যেক কর্মীকে প্রাক-অভিনাসনমুলক ব্রিফিং এ অংশগ্রহণ করতে হয়</li>\n	<li>আপনি যদি প্রাক-ভভিবাসনমূলক ব্রিফিং এ অংশগ্রহণ না করেন তবে সমসায় পড়বেন। মারা এই ব্রফিং এর জাল সনদ বিক্রি করে তা থেকে দুরে থাকুন।</li>\n	<li>আপনি জনশক্তি, কর্মসংস্থান ও প্রশিক্ষণ ব্যুরো (বিএমইটি) এর ব্রিফিং কেন্দ্র থেকে অথবা বিএমইটি কর্তক নির্ধারিত প্রতিস্থান থেকে ব্রিফিং নেবেন।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>প্রশিক্ষণে যে বিষয়গুলো আলোচনা করা হয়</strong></h3>\n\n<ul>\n	<li>সূচনা, প্রশিক্ষণের উদ্দেশ্য</li>\n	<li>বিদেশে কর্মসংস্থানের প্রস্তুতি</li>\n	<li>বৈদেশিক কর্মসংস্থান সংক্রান্ত বাংলাদেশের আইন;</li>\n	<li>অভিবাসী কর্মী ও তাদের পরিবারের অধিকার সম্পর্কিত আন্তর্জাতিক আইন;</li>\n	<li>কময় যে দেশে কাজ করতে যাবে সে গন্তব্য দেশের আইন এবং আন্তর্জাতিক আইন;</li>\n	<li>যে দেশে যাচ্ছে সেই দেশের প্রচলিত নিয়ম এবং অভিবাসন সম্পর্কিত তথ্য;</li>\n	<li>গঞন্তবা দেশের ঐতিহ্য, সংস্কৃতি, ধর্ম এবং ভৌগলিক অবস্থা সম্পর্কে তথ্য;</li>\n	<li>এ মহিলা কর্মীদের আত্মরক্ষার প্রয়ােজনীয়তা এবং বিভিন্ন কৌশল;</li>\n	<li>এ আচার, ব্যবহার, অধিকার, কল্যাণ ও শ্রমিকের কর্তব্য;</li>\n	<li>এইচআইভি ও এইডস সম্পর্কে প্রাথমিক তথ্য;</li>\n	<li>বিদেশে কাজ করতে যাওয়ার সময় যেসব কাগজপত্র অবশ্যই সাথে নিতে হবে, যেসব জিনিস সাথে নেওয়া যাবে না, বৈধ পথে দেশে টাকা পাঠানোর পদ্ধতি, বৈদেশিক কর্মসংস্থানের মাধ্যমে অর্জিত অর্থ ও দক্ষতার যথাযথ ব্যবহার ও সঞ্চয়ের অভ্যাস সম্পর্কিত তথ্য।</li>\n</ul>\n\n<h3><strong>জনশক্তি, কর্মসংস্থান ও প্রশিক্ষণ ব্যুরো (বিএমইটি) থেকে বিদেশে কাজ করতে যাওয়ার চু়ড়ান্ত অনুমোদন গ্রহণ :</strong></h3>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/isgOtzqg7jjglRZuc-SsFVTIax4pYB2IMWAIvarSk70uW-Gh0kjsi6NUK35_LLgI4CSIn2TTPAuX3y6pfjZ_lhwawotcMzVB3Aq9PhZpx2B4vtb9SeHRR20kGgXfR1t1p1iPHfld36hQjThVyj6JkLhV6VCLj67QnWTEmMHlCDvtG8S29R8kLPIJzAeJ2lhZha8NqADaflo68J1P9Z4miLD9DPuAaZ_bnO8CM8Qc62RnI2ql3BefIVh4YhHWfE81FRuirObgOHqn5_jZIvdBwbuWQapNHVRFejgdNBxatDbrpMQoGuQZs6pnyvNtPABaos1TcJ8Lqe5_IUfbJxdtkMALAdozx8M-DsJ0cAI_-6o19QygJV4zNfd_yPbgDMzcqn9GTC-DZ-Qf8c2K47oj0JKap20fEche7VLNv3OeenSEQrU6D7Kixb0YDsz2Sv_Y-cXI1qdbRj72Wt47A6m3o03kVeQo5FsJ10n9Nv54P8pDLNtNhfcx81phQo6FLGo78_D6NOcGIFK_EJ00fvb5Zbuga4x1jRgIVQ0jFHoOmXtONYdzn7aTDsHeBzOlHsLUj5l2QFH58JKlQybmY-twz_QqgXqnNmMoo-PLSYj5jk3nLrMgM8_Ceddc0Ft9UOe3yILViYAKvcaCOraR5KJBzmy11vsxupvs9ETHufL_sV-X87a2NO-how2fKSeB7LTlhkPWkYOTPhZib5Zn2EDYwpns-AvWhvb3BC4y905XjDjHUmM=w754-h654-no\" style=\"height:651px; width:750px\" /></p>\n\n<ul>\n	<li>সরকার কতৃক প্রদত্ত চূড়ান্ত অনুমোদন হচ্ছে বহিমিন ছাড়পত ও স্মার্ট কার্ড। চুক্তিপত্রে উল্লিখিত সমযের জন্য আকৰে এক অভিবাসন খ্রিফিং এবং স্বাস্থ্য পরীক্ষা খুলই গুরুত্বপূর্ণ। বিমানবন্দরের প্রাবাসী কল্যাণ ডেস্কে বাধ্যতামূলক ভাবে স্মার্ট কার্ড প্রদরশন কতে হবে।</li>\n	<li>অয়েজ আর্নার্স ওয়েলফেয়ার বোর্ডের (প্রবাসী কল্যাণ বোর্ডে) ছহনিলে কিছু টাকা জমা দিতে হবে। সে তা বিল বখে কাজ করতে যায় তারা যদি বিদেশে মৃত্যুবরণ করে বা সুটনার শিকার হয় তবে নিয়ম আনুযায়ি এই তহবিল থেকে তাদের আর্থিক সহযোগিতা প্রদান করা হবে।</li>\n</ul>\n\n<h3><strong>বহিঃগমন ছারপত্রের জন্য প্রয়োজনীয় কাগজপত্র</strong></h3>\n\n<ul>\n	<li>ভিসার কপি,</li>\n	<li>চাকুরীর চুক্তিপত্র;</li>\n	<li>মুল পাসপোর্ট ও নাগরিকত্ব সনদের কপি</li>\n	<li>স্বাস্থ্য পরীক্ষার সনদ</li>\n	<li>রিকুটিং এজেন্সিকে প্রদত্ত টাকার রশিদ</li>\n	<li>কল্যাণ তহবিলে জমাকৃত টাকার রশিদ।</li>\n</ul>\n\n<h3><strong>বিদেশে কর্মীর মৃত্যু হলে, কল্যাণ তহবিল থেকে আর্থিক সহযােগিতা পেতে যেসব কাগজপত্র প্রয়োজন:</strong></h3>\n\n<ul>\n	<li>মতের প্রকৃত ওয়ারিশদের ওয়ারিশান সনদ&#39; (প্রবাসী কল্যাণ ডেস্কে দেয়া নমুনা অনুযায়ী);</li>\n	<li>মতের প্রকৃত এয়ারিশ যদি চেক গ্রহণ করার জন্য উপস্থিত হতে না পারে তাহলে মনোনীত ব্যক্তিকে দেয়া ক্ষমতার্পন পত</li>\n	<li>মৃতের স্ত্রী স্বামী অথবা মৃত ব্যক্তি অবিবাযহিত হলে পিতা/মাতার ২ (দুই) কপি সত্যায়িত দবি এবং প্রযোজ্য ক্ষেত্রে ক্ষমতাপ্রাপ্ত ব্যক্তির ২ (দুই) কপি সত্যায়িত ছবি</li>\n	<li>মূল এয়ারওয়েজ বিলের কপি</li>\n</ul>\n\n<ol>\n	<li>মৃত দেহের সাথে প্রাপ্ত (Death Certificate),</li>\n	<li>NOC (No Objection Certificate),</li>\n	<li>মূল পাসপোর্টের ১-৯ পাতার ফটোকপি</li>\n	<li>বাংলাদেশ দূতাবাস হতে প্রাপ্ত সকল মূল কাগজ</li>\n</ol>\n\n<ul>\n	<li>চেক গ্রহণকালীন সময়ে মৃতের একজন ঘনিষ্ঠ আত্মীয়কে স্বাক্ষী হিসেবে উপস্থিত থাকতে হবে;</li>\n	<li>মৃতের স্ত্রীর/খামীর অথবা বিবাহিত না হলে পিতা/মাতার ভােটার আইডি কার্ডের সত্যায়িত ফটোকপি;</li>\n	<li>মৃত ব্যক্তি চাকুরীর জন্য বিদেশ গমন/বিদেশে কর্মরত ছিলেন তার প্রমাণ;</li>\n	<li>মৃতদেহ বাংলাদেশে পৌছানাের দিন থেকে ০৩ (তিন) মাসের মধ্যে মৃতদেহ পরিবহন ও দাফন খরচের টাকার জন্য সকল কাগজপত্রসহ আবেদনপত্র বিমানবন্দরের প্রবাসী কল্যাণ ডেস্কে অবশ্যই দাখিল করতে হবে।</li>\n</ul>\n\n<h3><strong>ভিসা পাওয়া :</strong></h3>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/zJyEDZn1dXTQAA2mdeqS2HT638_8KIYS6UkEa8caZQb3Fbchd0KtX_iOHsbwTqRHMEj8rRhdN_IrZOjv-jo-ANW3TWKiteNYEW2l1floCy9IBWThDl60RgbflH_y2sGCwwGpHUJWwH7AZPuyr0rQujO1Thnf5U-4fVCpTEMc6bWIsDU18S1KzfGWxRC1yTCHXU62vTuvTQ_YWxjKUTptAfEQPPTOx_dnr4o4iEImgXyd7WBe6V36jhCCrbvCUKVpoXtuLmMgw4tXLvJG8TaEW10mubLvRKlt_EQkmO2u76r4kBiV6RitSSS5RvTtas8CGGPk12_xSaN8OKk0dCBeXm0WQMSBdSLSSCvzXvvijmXdhR5ytIh-bxL2HOlNqQiA8PLMoZI8rw1_Lj7aNc4eWp7mn0TqHcGODg5zQMVtMZ1P-nZ_HYNlGgzMYVQXVmdX11C1OQRtovbTCgtk6g2nG3lAsktHlsYhi3tpIAkuY7OwZyRaYdedyXzK1U2BB-P9MxS1MrU71IuxUMHkOXs-VToEX4yKAQCpgmQ1YHk0HLzwCGKPlazMl6CLuF7CsL6NJPDHs6iFoUqhLWhRHXd2XBhsD88vR-t2lO9zhQT4J8T8Km9ZY_TbUSzhQodkyGNa0byo8DSOO64TDjAza7x3yMx7_mKsedqvGyOtxH3RN5otbil0h8YE9Tx6a_YdaWor_5z2j7wATHN6Z0Vz1z_h-OOLFVD7yIBgN5_jBCW81JOnp4M=w1020-h654-no\" style=\"height:481px; width:750px\" /></p>\n\n<ul>\n	<li>নিয়োগ প্রদানকারী কোম্পানী থেকে আপনি গন্তব্য দেশের ভিসা সংগ্রহ করবেন। ভিসা হচ্ছে গন্তব্য দেশে একটি নির্দিষ্ট সময় রাখবে থাকার অনুমতি পত্র এটির একটি নির্দিষ্ট মেয়াদ আছে। এই নির্দিষ্ট মেয়াদের মধ্যে আপনাকে নিজ দেশে ফেরত আসতে হবে। বাড়তি সময় থাকার জন্য আপনাকে নিয়োগদানকারী কোম্পানীর সাহায্যে ইমিযেশন অফিল লেকে ভিসার মেয়াদ বাড়িয়ে নিতে হবে।</li>\n	<li>ভিসা সংশ্লিষ্ট দেশের দূতাবাস থেকে দেয়া হয়। গন্তব্য দেশের নিয়ম অনুযায়ী ভিসা ফি পরিবর্তিত হতে পারে ভিসার জন্য প্রয়োজনীয় ফি পরিশোধের পর রশিদ গ্রহণ করা উচিত। একইভাবে ভিসা প্রাপ্তির পর রিক্রুটিং এজেন্সির টাকা পরিশোধের করে রশিদ নেওয়া উচিত।</li>\n	<li>ভিসা স্ট্যাম্পক্রিত হতে পারে বা স্টিকারের মত পাসপোর্টে আটকানো হতে পারে। আপনাকে অবশ্যই ভিসা পাবার পর তিন মাসের মধ্যে গন্তব্য দেশে পৌঁছাতে হবে।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>ফি পরিশোধ ও রশিদ গ্রহণ</strong></h3>\n\n<ul>\n	<li>আপনাকে অবশ্যই আগে থেকে জেনে নিতে হবে বিদেশে চাকুরী করতে যাওয়ার জন্য রিক্রুটিং এজেন্সিকে কত টাকা দিতে হবে</li>\n	<li>আাপনি সরাসরি রিক্রটিং এজেন্সিকে টাকা প্রদান করবেন। দালালরা অনেক বেশি টাকা নেয় এবং আপনার টাকা মার যেতে পারে</li>\n	<li>রিক্রুটিং এজেন্সিকে ফি পরিশোধের পর তাদের কাছ থেকে রশিদ সংরক্ষণ করুন! যদি কোন এজেন্সি রশিদ দিতে ইতস্তত বা দেরি করে তবে বুঝতে হবে এখানে প্রতারিত হওয়ার সম্ভাবনা আছে এবং দ্রুত এই বিষয়ে সংশ্লিষ্ট কর্তৃপক্ষ ও আইন প্রয়োগকারী সংস্থাকে জানাতে হবে।</li>\n</ul>\n\n<h3><strong>চাকুরীর চুক্তিপত্র (কন্ট্রাক্ট) :</strong></h3>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/fr40IHjhhpZBvux12BGnX-vRwxYkCmvKGOeR3JcOFh2LbMivfJsmBdY1JfbAyQe0WiVdx-4lSjBDEp4ITrRbuR5bH6JyoELtwEdWZnheR_ZlQYJ252X0d74PZ0yibhur4MsQKZ9wRdISMGMIA5xfjDCztTs8Ay7GtLLbow0eCpWxBrf-9xZMOyNS5bcJ9og7T__nU244WuZ6Y4ihhSJ1KxFUK8iW6_4JKWSuKDHa5KMc6JQnIuCBNc7tibxK8hniYVJ38dtmKUSJVbys2HD-9HKdGyGSUvK_xVW8nQ8qHcsbAE5aT46f19nqHtvCMGOK6DvQhdJqkgIolt2QPJBfHP_CTUmXfZuYpmyuy5gwn4OiVkb9HB7JTIOkcxLkXEGSZx6ByQ3ofXF3ZB20LaQPpyrHhD6lzvxcVZCuFihStmRfohPbD5SJCQ8sYT8Voh-ZOz7utrCenRuINOSlNKaSgfC6W4ByTdBE_vAEeglqh7iT_vwTyjdVaSTo-q_A6r442h3jrzD8q1Gzrn2aPl1U67lty9tVkXoD3RNwZhDCFbkXNwbOCNyVBxvrCVdPHIi2zpxDrKiGs2pv0UFu-xtFt1wtC-_YiqC4akmTjJOK5K9I6MA_IkLoMrmbgs4_UytH6qWN0D-yMZeHkulbur6G_NhSv6laE4AYuO8S3Re7X2jyDjS9BqHpxm0onMdCwnA3ULMU4rDelWxRqjJBik7MQHaGSPStIPJV3nj49nQra01faBc=w743-h654-no\" style=\"height:660px; width:750px\" /></p>\n\n<p>চক্তিপত্রটি তৈরি করা হবে কর্মী, রিক্রুটিং এজেন্সি এবং সংশ্লিষ্ট নিয়োগকর্তা কোম্পানীর সাথে। চুক্তিপত্রটি আপনার ও</p>\n\n<p>নিয়োগকর্তা কোম্পানীর মধ্যে দ্বিপাক্ষিক সমঝোতা। চাকুরীর শর্তাবলী এই চুক্তিপত্রে থাকে। চুভতিপত্রে নিমে উদ্লিখিত বিষয়গুলো থাকতে হবে</p>\n\n<ul>\n	<li>যে কোম্পানীতে কাজ করবেন তার নাম</li>\n	<li>যে কাজ গুলো কর্মীকে তে হবে/শিক্ষানবীস কাল;</li>\n	<li>বেতন সুবিধা/মাসিক বেতন:</li>\n	<li>খাবার এবং বাসস্থান সুবিধা:</li>\n	<li>বার্ষিক ছুটির নিয়ম</li>\n	<li>কে কোম্পানী বা আপনি) প্লেনে যাতায়াত ভাড়া বহন করবে;</li>\n	<li>চুক্তির সময়সীমা বাড়ানাের সুযোগ আছে কি-নেই;</li>\n	<li>দুর্ঘটনার জন্য বীমা ব্যবস্থা আছে কি-নেই;</li>\n	<li>স্বাস্থ্য পরীক্ষার খরচ কে (কোম্পানী বা আপনি) বহন করবে:</li>\n	<li>চিকিৎসা সুবিধ;</li>\n	<li>দৈনিক কর্ম ঘন্টা</li>\n	<li>ওভার টাইম এর নিয়ম</li>\n	<li>অন্যান্য প্রয়োজনীয় বিষয়।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>এইসব বিষয়ে নিশ্চিত হয়ে চুক্তিপত্রে সাক্ষর করবেন</p>', NULL, NULL, NULL, NULL, '2020-02-11 15:26:31', 1, NULL, NULL, 'বিদেশ-যাত্রার-প্রস্তুতি', 'http://api.immigration.orangebd.com/images/bL2RhdSofxqULeIy.png', 1, 1, '1970-01-01', NULL, '2020-02-11 15:26:31', '2020-03-04 20:51:59');
