(56, 4, NULL, NULL, 'বৈধ ভাবে টাকা পাঠানো', NULL, 1, NULL, '<ul>\n	<li><strong>বিদেশ থেকে টাকা পাঠানোর নিয়মাবলী কী?</strong></li>\n</ul>\n\n<p>দুই ভাবে আপনি টাকা পাঠাতে পারেনঃ (১) ক্যাশ পেমেন্ট (২) ব্যাংক একাউন্ট ডিপোজিট টাকা পাঠানোর সময় আপনাকে ব্যাংক অথবা মানি ট্রান্সফার এজেন্টকে নিম্নলিখিত তথ্য দিতে হবেঃ (১) ব্যাক্তিগত তথ্যঃ আপনার নাম, ঠিকানা এবং ফোন নাম্বার (২) টাকা পাঠানোর স্থান ও দেশের নাম (৩) টাকার পরিমান (৪) প্রাপকের তথ্যঃ (ক) ক্যাশ পেমেন্টের ক্ষেত্রে প্রাপকের নাম, ঠিকানা (জেলার নাম)এবং ফোন নাম্বার (খ) ব্যাংক একাউন্ট ডিপোজিটের ক্ষেত্রে প্রাপকের নাম, ঠিকানা (জেলার নাম), ফোন নাম্বা্র, ব্যাংকের নাম, ব্যাংকের শাখার নাম এবং হিসাব(অ্যাকাউন্ট) নাম্বার Bank Secrecy Act অনুসারে উপরোক্ত তথ্য ছাড়াও কিছু অতিরিক্ত তথ্য আপনাকে দিতে হতে পারেঃ ১. সোশাল সিকিউরিটি নাম্বারঃ তিন হাজার ডলার বা তদূর্ধ্ব যে কোণ পরিমানে ডলার পাঠালে ২. কর্মক্ষেত্রের তথ্যঃ পাঁচ হাজার ডলার বা তদূর্ধ্ব যে কোণ পরিমানে ডলার পাঠালে কর্মক্ষেত্রের তথ্য (পেশা, এমপ্লয়ারের নাম, ঠিকানা, ফোন নাম্বার) আপনি যদি এক দিনে দশ হাজার ডলারের উর্ধে যে কোনো পরিমান ডলার পাঠান তবে ব্যাংক বা মানি ট্রান্সফার প্রতিষ্ঠান তা FinCen কে রিপোর্ট করবে ।</p>\n\n<ul>\n	<li><strong>ইন্টারনেট ব্যাঙ্কিং</strong></li>\n</ul>\n\n<p>আজকাল ইন্টারনেটের কল্যাণে বিদেশে টাকা পাঠানো অনেক সহজ হয়ে গেছে। তারপরও সঠিক পদ্ধতি জানা না থাকলে টাকা পাঠানোর খরচ অনেক সময়ে বেশি লেগে যায় এবং কখনও কখনও প্রতারণার শিকারও হতে হয়।আসুন জেনে নেওয়া যাক কিভাবে বিদেশ থেকে দেশে বৈধ ভাবে টাকা পাঠানোর প্রচলিত এবং সহজ উপায়</p>\n\n<p><strong>বিকাশ </strong></p>\n\n<p>বিদেশে বসবাসরত প্রবাসী বাংলাদেশীরা খুব সহজে এবং সুবিধাজনক পদ্ধতিতে অনুমোদিত এবং তালিকাভুক্ত ফরেইন ব্যাংক, মানি ট্রান্সফার অর্গানাইজেশন(এমটিও) এবং মানি এক্সচেইঞ্জ হাউজগুলোর মাধ্যমে বাংলাদেশে প্রিয়জনের বিকাশ একাউন্টে টাকা পাঠাতে পারবেন।</p>\n\n<p>বিদেশ থেকে বাংলাদেশে বিকাশ একাউন্টে টাকা পাঠাতে&nbsp;</p>\n\n<ul>\n	<li>অনুমোদিত এবং পার্টনার ব্যাংক ব্রাঞ্চ/মানি এক্সচেইঞ্জ/এমটিও এজেন্ট-এর কাছে যান</li>\n	<li>বিকাশ একাউন্ট নাম্বার এবং পুরো নাম প্রদান করুন (বিকাশ একাউন্ট খোলার সময় )</li>\n	<li>প্রয়োজনীয় টাকা প্রদান করুন এবং ব্যাংক/মানি এক্সচেইঞ্জ/এমটিও এজেন্ট-কে কাজটি শুরু এবং সম্পন্ন করতে অনুরোধ করুন</li>\n</ul>\n\n<p>ব্যাংক/এক্সচেইঞ্জ হাউজ/এমটিও এজেন্ট বিদেশ থেকে টাকা পাঠানোর সময় নিম্নলখিত বিষয়গুলো নিশ্চিত করে থাকেনঃ</p>\n\n<ul>\n	<li>প্রাপকের একটি রেজিস্টার্ড এবং বৈধ বিকাশ একাউন্ট রয়েছে</li>\n	<li>প্রাপকের বিকাশ একাউন্ট নাম্বার এবং পুরো নাম সঠিকভাবে প্রদান করা হয়েছে</li>\n	<li>পাঠানো রেমিটেন্স (বাংলাদেশী টাকায়) সীমা অতিক্রম করছে না*</li>\n	<li>তালিকাভুক্ত মানি এক্সচেইঞ্জ/ব্যাংকসমূহ এবং যেসব দেশ থেকে রেমিটেন্স বা টাকা পাঠানো যাবেঃ</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/gacNBiKTGhvY13Ux7_2kSaa8f_bNUPryailxxeZ6i6pMGjJLyamU2ILeyBmg-IByeOo6g8SIPGzybIJKgiuuRprjXkyqeLyNtv3NfmD_Nd1pDiOa09Dt2Gj91fhrP7KEiI3o5QgsKvbd3IGyvR_orhS1GcUowQSMOjVnd2MvTK3m8sQvPNEsbCvls093a9DWcBc4srjCwVYDGM7A2BsXs9PUiEDM3oxUxOEieB4hDtGOPcYFwKBUxbkvhbGwKwJqQJH7DKOkiza0C9Ih0ZlYv2iUxS9sGIzVQMQBK7pWlZT84x5-GaoxtcTjYgv6FrIIsnnIhGHp-z8jrEvuK-VVONGowv5eEarL5EnzLLLwbi8v0o7vXcXvPANrKTZVV9HKIvLjCKsDLQhPbOF8_42MuOULgvOqtpIm1_CmIcGoyC4IpuboeC1s9MEgWx6Hr3A_KsEDH_HqmIrG_uXGwSTE9bg8iEztDZ9A3yFFgnTHX_HyDrIepay7SpOoCMGgEwvGJMBrpSZX6I1Nat9HaRlORL5oIchaKkpELAtxwOU0a4K_5yitEkz2Mmzxp4KK2ea2U8Ix3DonRxDYxIwZylQK5gBE5wakXn9fT0yGEMOpq-jus5nAR--xoBespKOdczGM_Dv10pG15lX3Hg-Hn-G1ObRGf9fmpWm1XdjZ1dGJ2o0gIvMppLbvV_M6GdFbDDWdwJoAJEVaCkD4ttGWvAPxS0tI66Gwvjn7UMiAgqpbAfuG2D0HWe4SDQ=w450-h654-no\" style=\"height:654px; width:449px\" /></p>\n\n<ul>\n	<li><strong>বিদেশ থেকে ওয়েস্টার্ন ইউনিয়নে পাঠানো টাকা যেভাবে তুলবেন</strong></li>\n</ul>\n\n<p>বিদেশ থেকে ওয়েস্টার্ন ইউনিয়নের মাধ্যমে পাঠানো টাকা এখন বাংলাদেশে ঘরে বসেই বিকাশ একাউন্টে তোলা সম্ভব হবে। মাস্টারকার্ড, ওয়েস্টার্ন ইউনিয়ন, ব্র্যাক ব্যাংক ও বিকাশ যৌথভাবে এই সেবা চালু করেছে। প্রবাসী বাংলাদেশিরা এই পদ্ধতিতে খুব সহজেই দেশে স্বজনদের নিকট বিকাশে টাকা পাঠাতে পারবেন।</p>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/cihpxLh-C8NyIoOqVCycHxDh5TiYZoXJWwhBJvnYkxuhnVpIipRAg59ZtObA44p8wAr2jz-L2i6lUdrstjtMLuIXXSYONqzG2zPCxIkLbLYTHeuL3s3PnCoN3_RZOCHJJZjPeU7eLgoOXQyB7R3TWnRRj7WHE4-nJoqdhxJJVMpDIg7SAnLN4enSG8SzqQ6eZsG20cj9dHX44KY27HqquAG1hQML3UjagiAXCEEjFAP_0U8h1rtZ6VxvifUk0nGuMzOwBZqB_gkfMqYkbxgzbfuTaUwWDDpd-Syczf4E2gDXKche15t6N6fdVg4d87PIdjKNI4nIA8x5k3Wv0sHBmIUr3UY2ZzD-NZ-tIzO42S2jqzV5dDT1M5uSttubOVSkqzQw_9hb7oLcOIbomwdTCPZAdosbTWZOjvS0hr6-zeN67uemUsCYLYjzIvA7XKkUWF4kF9TakVbFpM9wryDz2ci11OyOPLfWKuQFFKcHdHNFhqJjxEZAy1ravYFd6aUkfiSMiIke1174eDvjFf9eneVOq-GmA7FeUeukHCPogvckDt72xFAiLDZm4Myh3s2BBU47tMjGxI9KOROSKCj-NDZ1UQiAsEMVcXS3tcy4p8EK1wCrMVaYt-aJ0oG8X3ubasA4Rw-Bt-RXViG0Srymbk-K0DgDes8AnIT-N-v7V48c-fhDZQrHDeGJgxr0nueDmdBew_-nCLx4_J9t1bGrP7hvMqHIR5QluUjhHe0umDW4Mo-UtJ7rbw=w498-h362-no\" style=\"height:362px; width:498px\" /></p>\n\n<p>বিদেশ থেকে এই পদ্ধতিতে বিকাশে টাকা পাঠানো ও তোলার জন্য নিচের ধাপগুলো অনুসরণ করতে হবেঃ</p>\n\n<p>১. প্রথমেই ওয়েস্টার্ন ইউনিয়নের নির্ধারিত এজেন্টের কাছে গিয়ে একটি ফরমে বাংলাদেশে অবস্থানরত প্রাপকের নাম ও ঠিকানা লিখতে হবে। তারপর নির্দিষ্ট পরিমাণ অর্থ জমা দিলে ওয়েস্টার্ন ইউনিয়নের ঐ এজেন্ট ওয়েস্টার্ন ইউনিয়নের বিশেষ রেফারেন্স নম্বর (এমটিসিএন) প্রবাসীকে দেবেন। অর্থ লেনদেনের জন্য ব্যবহৃত ১০ সংখ্যার এই নির্দিষ্ট নম্বরটি &ldquo;এমটিসিএন&rdquo; নামে পরিচিত। এই এমটিসিএন নম্বর ও পাঠানো টাকার পরিমাণ দেশে থাকা প্রাপককে জানাতে হবে।</p>\n\n<p>২. দেশে অবস্থানরত প্রাপক তার মোবাইলে বিকাশ একাউন্টে প্রবেশ করার জন্য মোবাইলে *২৪৭# নম্বরে ডায়াল করবেন। এখন যে বিকাশ মেন্যু আসবে, সেখান থেকে Remittance (রেমিট্যান্স) এ প্রবেশ করতে হবে। তাহলে ওয়েস্টার্ন ইউনিয়ন অপশন পাওয়া যাবে। ওয়েস্টার্ন ইউনিয়নে প্রবেশ করে ওয়েস্টার্ন ইউনিয়নের সেই রেফারেন্স নম্বর বা এমটিসিএন প্রদান করতে হবে। এরপর পাঠানো টাকার পরিমাণ সংখ্যায় লিখে এন্টার/সেন্ড করতে হবে। সবশেষে বিকাশ একাউন্টের পিন নম্বর প্রবেশ করে সেন্ড করতে হবে। কিছুক্ষণের মধ্যেই মোবাইলে বিকাশে টাকা জমা হওয়া সম্পর্কিত মেসেজ আসবে।</p>\n\n<p><strong>পুরো প্রক্রিয়াটি সম্পন্ন হতে মাস্টার কার্ড, ওয়েস্টার্ন ইউনিয়ন ও বিকাশের প্রযুক্তি ব্যবহৃত হবে।</strong></p>\n\n<p>এই পদ্ধতিতে একজন গ্রাহক প্রত্যেকবার সর্বোচ্চ ৩৫ হাজার টাকা পাঠাতে/তুলতে পারবেন। এক দিনে সর্বোচ্চ ১ লাখ ১৫ হাজার টাকা তোলা/পাঠানো যাবে। একজন দিনে ৫ বার লেনদেন করতে পারবেন। মাসে ২০ বার টাকা তোলা/পাঠানো যাবে। এক মাসে সর্বোচ্চ ১ লাখ ৫০ হাজার টাকা তোলা/পাঠানো যাবে। আরও জানতে বিকাশ হেল্পলাইন ১৬২৪৭ নম্বরে অথবা +৮৮০২৮৩৩১৪৬৯ নম্বরে সকাল ৮:৩০ থেকে রাত ১০:০০ টার মধ্যে ফোন করুন।</p>\n\n<ul>\n	<li><strong>ডাচ্ বাংলা ব্যাংক মোবাইল ব্যাংকিং</strong></li>\n</ul>\n\n<p>কিভাবে ডাচ্ বাংলা মোবাইল ব্যাংকিং এর মাধ্যমে বিদেশ থেকে টাকা বাংলাদেশে পাঠানো যায়? এই জন্য আপনার দরকার একটি Aprove হওয়া ডাচ্ বাংলা মোবাইল ব্যাংকিং একাউন্ট এবং যে দেশ থেকে টাকা আসবে, সেদেশে ডাচ্ বাংলা ব্যাক মনোনিত এক্সচেঞ্জ হাউজ্।</p>\n\n<p><strong>বিদেশ থেকে টাকা আনার প্রক্রিয়াঃ</strong></p>\n\n<ul>\n	<li>যে ব্যক্তি বিদেশ থেকে মোবাইল ব্যাংকিং একাউন্টে টাকা পাঠাবে, সে ব্যক্তি বিদেশে অবস্থিত প্রেরক ডাচ্ বাংলা ব্যাকের মনোনীত একচেঞ্জ হাউজে উপস্থিত হয়ে গ্রাহকের 12 ডিজিটের মোবাইল ব্যাংকিং একউন্ট নম্বর, একাউন্ট হোল্ডারের নাম, ব্যাংকের নাম (এক্ষেত্রে ডাচ্ বাংলা ব্যাংক) উল্লেখ করে একচেঞ্জ হাউজে টাকা জমা &zwj;দিবেন।</li>\n	<li>টাকা গ্রাহকের মোবাইল ব্যাংকিং একাউন্টে সরাসরি জমা হবে এবং গ্রাহক তাৎক্ষনিক এস এম এস এর মাধ্যমে তা জানতে পারবেন।</li>\n	<li>গ্রাহক নিকটবর্তী ATM, মনোনীত এজেন্ট পয়েন্ট অথবা DBBL এর যেকোন শাখা থেকে টাকা উত্তোলন করতে পারবেন।</li>\n</ul>\n\n<p><strong>DBBL মনোনীত একচেঞ্জ হাউজ সমূহঃ</strong></p>\n\n<p>&nbsp;</p>\n\n<table align=\"center\" cellspacing=\"0\" style=\"border-collapse:collapse\">\n	<tbody>\n		<tr>\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:1px solid black; vertical-align:top; width:55px\">\n			<p><strong>Sl</strong></p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; vertical-align:top; width:370px\">\n			<p><strong>Name Of Exchange House</strong></p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; vertical-align:top; width:154px\">\n			<p><strong>Sending Country</strong></p>\n			</td>\