(70, 5, NULL, NULL, 'বিদেশে যাওয়ার পূর্বে আমি কি ধরণের প্রস্তুতি নিতে পারি?', NULL, 1, NULL, '<h2><strong>বহির্গমন ছাড়পত্র প্রদান:</strong></h2>\n\n<p>স্ব-উদ্যোগে বা আত্মীয়-সজনের মাধ্যমে ওয়ার্ক-পারমিট/এনওসি/এন্ট্রি-পারমিট সংগ্রহ করলে জনশক্তি কর্মসংস্থান প্রশিক্ষণ ব্যুরোতে উপস্থিত হয়ে বা রিক্রুটিং এজেন্টের মাধ্যমে বহির্গমন ছাড়পত্রের (Emigration Clearance)জন্য আবেদন করতে হবে।</p>\n\n<p>ছাড়পত্রের জন্য নিম্মোক্ত কাগজপত্র জমা দিতে হয়&nbsp;</p>\n\n<p>জেলা কর্মসংস্থান ও জনশক্তি অফিস থেকে নিবন্ধনকৃত কার্ড;</p>\n\n<p>ভিসার পৃষ্ঠাসহ পাসপোর্টের প্রথম ৬ পৃষ্ঠার ফটোকপি;</p>\n\n<p>মূল ভিসা এ্যাডভাইস/এন্ট্রি-পারমিট/ওয়ার্ক-পারমিট/এনওসি ও ফটোকপি;</p>\n\n<p>১৫০/০০ টাকা মূল্যমানের নন-জুডিশিয়াল ষ্ট্যাম্পে ব্যক্তিগত অঙ্গীকারনামা;</p>\n\n<p>পেশাজীবীদের ক্ষেত্রে সরকারি/স্বায়ত্বশাসিত/রাষ্ট্রায়ত্ব প্রতিষ্ঠানে কর্মকর্তাদেরকে সংশ্লিষ্ট নিয়োগকর্তা হতে রিলিজ অর্ডার বা প্রেষণপত্র;</p>\n\n<p>একক ভিসার বিদেশগামী মহিলার ক্ষেত্রে আইনানুগ অভিভাবক থেকে ১৫০/০০ টাকার নন-জুডিশিয়াল স্ট্যাম্পে অনাপত্তি পত্র।</p>\n\n<p>পেশাজীবীদের ক্ষেত্রেসরকারি/স্বায়ত্তশাসিত/রাষ্ট্রায়ত্ব প্রতিষ্ঠানে র্কমর্কতাদরেকে সংশ্লিষ্টনিয়োগকারী হতে রিলিজ র্অডার বা প্রেরনপত্র;</p>\n\n<p>একক ভিসায়বিদেশগামিমহিলারক্ষেত্রে আইনানুগ অভিবাবকথেকে ১৫০/০০ টাকার নন-জুডিশিয়াল স্ট্যাম্পে অনাপত্তি পত্র।</p>\n\n<h3><strong>বিদেশে যাওযার পূর্বে যা নিশ্চিত হওয়া প্রয়োজন :</strong></h3>\n\n<p>নিম্ম বর্ণিত কাগজপত্র আপনার কাছে রয়েছে কিনা?</p>\n\n<p>১.&nbsp;&nbsp;&nbsp;পাসপোর্ট</p>\n\n<p>২.&nbsp;&nbsp;&nbsp;চাকুরীর চুক্তিপত্র</p>\n\n<p>৩.&nbsp;&nbsp;&nbsp;ব্যাংক একাউন্ট খোলা হয়েছে</p>\n\n<p>৪.&nbsp;&nbsp;&nbsp;দূতাবাসের ঠিকানা ও ফোন নাম্বার</p>\n\n<p>৫.&nbsp;&nbsp;&nbsp;ভিসা</p>\n\n<p>৬.&nbsp;&nbsp;&nbsp;জনশক্তি ব্যুরোর ছাড়পত্র</p>\n\n<p>৭.&nbsp;&nbsp;&nbsp;মেডিকেল রিপোর্ট</p>\n\n<p>৮.&nbsp;&nbsp;&nbsp;টিকিট</p>\n\n<p>৯.&nbsp;&nbsp;&nbsp;টাকা প্রদানের রশিদ চুক্তিপত্র পরীক্ষা</p>\n\n<p>&nbsp;</p>\n\n<h3>বিদেশে যাওয়ার কমপক্ষে দু&rsquo;দিন আগে এজেন্সির কাছ থেকে চুক্তিপত্র নিতে হবে এবং চুক্তিপত্রে যে বিষয়গুলো পরীক্ষা করে নেবেনঃ</h3>\n\n<p>১.&nbsp;চাকুরীর নাম &nbsp;</p>\n\n<p>২। কোম্পানি বা চাকুরীদাতার নাম,ঠিকানা&nbsp;</p>\n\n<p>৩। কর্মক্ষেত্র&nbsp;&nbsp;</p>\n\n<p>৪। চাকুরীর মেয়দা/চুক্তির মেয়াদ</p>\n\n<p>৫। মাসিক বেতন&nbsp;&nbsp;</p>\n\n<p>৬। ছুটি ও সামাজিক নিরাপত্তা</p>\n\n<p>৭। যাওয়া আসার বিমান ভাড়া&nbsp;</p>\n\n<p>৮। নিয়মিত কর্ম-ঘন্টা এবং সাপ্তাহিক ছুটি</p>\n\n<p>৯। ওভার-টাইম&nbsp;</p>\n\n<p>১০। বাৎসরিকছুটি&nbsp;</p>\n\n<p>১১। বেতনসহ ছুটি না বেতন ছাড়া ছুটি&nbsp;</p>\n\n<p>১২। অসুস্থতার ছুটি</p>\n\n<p>১৩। মেডিকেল বা স্বাস্থ্যসেবার সুবিধা</p>\n\n<p>১৪। কর্মক্ষেত্র সম্পর্কিত অসুস্থতা বা মৃত্যুর জন্য ক্ষতিপূরনের অংক</p>\n\n<p>১৫। যাতায়াত ভাড়া&nbsp;</p>\n\n<p>১৬। খাবার ভাতা&nbsp;</p>\n\n<p>১৭। বাসস্থান ভাতা&nbsp;</p>\n\n<p>১৮। মৃত্যু হলে লাশ দেশে পাঠানোর ব্যবস্থা ইত্যাদি।&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h3><strong>প্রবাসে যা যা করণীয় :</strong></h3>\n\n<ul>\n	<li>কোথাও গেলে নিয়োগকারীর অনুমতিসাপেক্ষে গমন করবেন।</li>\n	<li>কর্মরত অবস্থায় সংশ্লিষ্ট দেশের কর্মস্থলের রীতিনীতি মেনে ও শৃঙ্খলা মেনে চলবেন।</li>\n	<li>আপনার অর্জিত অর্থ বৈধভাবে ব্যাংকের মাধ্যমে দেশে প্রেরণ করবেন। অবৈধভাবে বা হুন্ডির মাধ্যমে অর্থ প্রেরণ করবেন না।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>যে কারণে কর্মীদের দেশে ফেরত পাঠানো হয় :</strong></h3>\n\n<ul>\n	<li>ভিসার মেয়াদ শেষ হয়ে যাওয়া।</li>\n	<li>ওয়ার্ক-পারমিট না থাকা।</li>\n	<li>মেডিকেল পরীক্ষায় জন্ডিস,যক্ষা,হাঁপানি,এইচআইভি / এইডস পজেটিভ বা বিভিন্ন যৌনরোগ ধরা পড়া।</li>\n	<li>নিয়োগকর্তার সাথে ভাল সর্ম্পক না থাকা।</li>\n	<li>বে-আইনি ভাবে চাকুরী পরিবর্তন করা বা কর্ম স্থল থেকে পলায়ন করা।&nbsp;</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>বিদেশে যাওয়ার সময় যাত্রাপথে যা যা করবেন :</strong></h3>\n\n<ul>\n	<li>বিদেশে যাওয়ার পথে যা যা নিতে হবে তার একটি তালিকা তৈরি করবেন।</li>\n	<li>ক্যারি-অন ব্যাগ বা যে ব্যাগটি বিমানে নিজের সাথে রাখবেন সেখানে টাকা-পয়সা, গহনা, ভ্রমন ও চাকুরী সংক্রান্ত কাগজপত্র রাখবেন।</li>\n	<li>চেক-ইন ব্যাগ বা যে ব্যাগটি বিমানে দেবেন, সে ব্যাগ ওজন করবেন এবং ২০ কেজি ওজনের মধ্যে সীমাবদ্ধ রাখবেন।</li>\n	<li>ব্যাগটি দড়ি বা প্যাকিং টেপ দিয়ে শক্ত করে বেধে নেবেন, যাতে যাত্রাকালীন সময়ে ব্যাগ ছিঁড়ে না যায়।</li>\n	<li>ভ্রমণের জন্য হালকা কিন্তু শক্ত উপাদান দিয়ে তৈরি এবং ভাল তালার ব্যব&macr;হাসহ ব্যাগ কিনবেন।</li>\n	<li>প্রতিটি ব্যাগে নাম, ঠিকানা ও ফোন নাম্বার লিখে রাখবেন।</li>\n	<li>বিদেশে যাওয়ার পথে যা যা নিতে হবে তার একটি তালিকা তৈরি করবেন।</li>\n	<li>ক্যারি-অন ব্যাগ বা যে ব্যাগটি বিমানে নিজের সাথে রাখবেন সেখানে টাকা-পয়সা, গহনা, ভ্রমন ও চাকুরী সংক্রান্ত কাগজপত্র রাখবেন।</li>\n	<li>চেক-ইন ব্যাগ বা যে ব্যাগটি বিমানে দেবেন, সে ব্যাগ ওজন করবেন এবং ২০ কেজি ওজনের মধ্যে সীমাবদ্ধ রাখবেন।</li>\n	<li>ব্যাগটি দড়ি বা প্যাকিং টেপ দিয়ে শক্ত করে বেধে নেবেন, যাতে যাত্রাকালীন সময়ে ব্যাগ ছিঁড়ে না যায়;</li>\n	<li>ভ্রমণের জন্য হালকা কিন্তু শক্ত উপাদান দিয়ে তৈরি এবং ভাল তালার ব্যব&macr;হাসহ ব্যাগ কিনবেন;</li>\n	<li>প্রতিটি ব্যাগে নাম, ঠিকানা ও ফোন নাম্বার লিখে রাখবেন।</li>\n	<li>চেক-ইন ব্যাগ, অর্থাৎ যে ব্যাগ লাগেজ হিসেবে বিমানে দিয়ে দেবেন সেখানে টাকা-পয়সা, গহনা, ভ্রমন ও চাকুরী সংক্রা&scaron;ত কাগজপত্র এবং অন্যান্য মূল্যবান জিনিস রাখবেন না;</li>\n	<li>অপরিচিত ব্যক্তির দেয়া কোন জিনিসই বহন করবেন না।</li>\n	<li>কখনোই ধারালো বস্তু, যেমন- বেড, কাঁচি, ছুরি ইত্যাদি সিকিউরিটি চেকের সময় ধরা পড়ে এবং ফেলে দেয়া হয়।</li>\n	<li>নিষিদ্ধ কোনো জিনিস ব্যাগে নেয়া যাবে না, যেমন-</li>\n	<li>প্লেনে ও এয়ারপোর্টে ধূমপান নিষিদ্ধ।</li>\n	<li>প্লেনে মোবাইল ফোন ও ট্রানজিষ্টার রেডিও ব্যবহার করা নিষেধ।</li>\n	<li>আগ্নেয়াস্ত্র ও বিস্ফোরক জাতীয় পর্দাথ।</li>\n	<li>নিষিদ্ধ মাদক ও ড্রাগ।</li>\n	<li>আগুন ধরে এমন তরল পর্দাথ (লাইটার) ।</li>\n	<li>দুর্গদ্ধ বের হয় এমন পদার্থ।</li>\n	<li>মাংস, দুধ, ডিম ও অন্যান্য পোল্ট্রিজাতীয় খামার, ফুল, ফল, সবজি, পান, গুল, সাদাপাতা ইত্যাদি।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>ইমিগ্রেশন সম্পর্কিত তথ্য :</strong></h3>\n\n<p>&nbsp;&nbsp; কাউন্টারে প্রার্থীর পাসপোর্ট, ভিসা, জনশক্তি ব্যুরোর ছাড়পত্র ইত্যাদি পরীক্ষা করে সঠিক থাকলে কেবল:</p>\n\n<ul>\n	<li>পাসপোর্ট সিলমোহর করে প্রার্থীকে ভেতরে প্রবেশ করার অনুমতি দেয়া হয় এবং</li>\n	<li>সেখানে বিমানে আরোহণের পূর্ব পর্যন্ত অপেক্ষা করতে হয়;</li>\n	<li>ইমিগ্রেশনের সামনে লাইন দিয়ে দাঁড়ান,</li>\n	<li>আপনার পাসর্পোট, ভিসা, ইমিগ্রেশন/ডিসএম্বারকেশন ও কাষ্টমস ফরমসহ তৈরী থাকুন।</li>\n	<li>অফিসার আপনার পাসপোর্টে ওই দেশে গমনের তারিখসহ সিল দিয়ে দেবে।</li>\n</ul>\n\n<h3><strong>বিমানে কি করবেন ?</strong></h3>\n\n<ul>\n	<li>বিমানে আরোহণের পূর্বে ইংরেজিতে ও বাংলায় মাইক্রোফোনে ঘোষনা করা হয় এবং</li>\n	<li>ডিসপ্লে বোর্ড ও টেলিভিশন মনিটরে দেখানো হয়।</li>\n	<li>ঘোষণার পরই বোর্ডিং-কার্ড হাতে নিয়ে বিমানের দিকে অগ্রসর হতে হয়।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>বিদেশে পোঁছানোর পর বিমানবন্দরে করণীয় :</strong></h3>\n\n<ul>\n	<li><strong>ব্যাগ সংগ্রহ :</strong> ব্যাগেজ সংগ্রহের জন্য কনভেয়ার বেল্টের সামনে দাঁড়ান। কনভেয়ার বেল্টের ওপর আপনার ফ্লাইট নাম্বার দেয়া থাকবে, সেটা খেয়াল করুন।</li>\n	<li><strong>কাষ্টমস:</strong> আপনার কাষ্টমস ডিক্লারেশন ফরম দিন । কাষ্টমস অফিসার চাইলে ব্যাগ খুলে দেখান।</li>\n	<li><strong>হারানো ব্যাগ খোঁজা:</strong>বেল্টে ব্যাগ না পাওয়া গেলে বা ব্যাগ হারানো গেলে সাথে সাথে এয়ারলাইন্স কর্তৃপক্ষকে জানান এবং ক্লেইম ফরম পূরণ করুন। প্রয়োজনে তথ্যকেন্দ্রের সহায়তা নিন,এয়ারলাইন্স আপনার ব্যাগ খুঁজে বের করে আপনার চুড়ান্ত গন্তব্যে যোগাযোগ করবে,আপনার হারানো ব্যাগ আপনাকে পৌছে দেয়া হবে। না পাওয়া গেলে টিকেটে উল্লিখিত নীতিমালা অনুযায়ী আপনাকে ক্ষতিপূরণ দেয়া হবে।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>বিদেশে দূঘটনা, ক্ষতিপূরণ ও যে কোন সমস্যায় সহযোগিতার জন্য যেখানে যোগাযোগ করবেন :</strong></h3>\n\n<ul>\n	<li>বাংলাদেশ দূতাবাস</li>\n	<li>অভিবাসী কমিউনিটি বা অন্য শুভাকাঙ্খী সহকর্মী</li>\n	<li>বিদেশে মানবাধিকার সংস্থা (যদি থাকে)</li>\n	<li>উন্নয়ন সংস্থা বা এনজিও সমূহ (যদি থাকে)।</li>\n	<li>বিভিন্ন আইন প্রয়োগকারী সংস্থা (পুলিশ স্টেশন)</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>বিদেশে সমস্যামুক্ত থাকার জন্য করণীয় :</strong></h3>\n\n<ul>\n	<li>&nbsp;বাংলাদেশী দূতাবাসের ঠিকানা ও ফোন নাম্বার সংগ্রহ করুন</li>\n	<li>&nbsp;যে দেশে কাজ করছেন সে দেশের শ্রম আইনসমূহ জেনে রাখুন</li>\n	<li>হাসপাতাল, স্বাস্থ্যকেন্দ্র ও পুলিশ স্টেশনের ঠিকানা ও ফোন নাম্বার সংগ্রহ করুন</li>\n	<li>বিদেশে বাংলাদেশী ব্যাংকসমূহের ঠিকানা ও ফোন নাম্বার সংগ্রহ করুন এবং নিজ নামে ব্যাংকে টাকা রাখুন</li>\n	<li>নিজস্ব তথ্য, পাসপোর্ট, টাকা-পয়সা অন্যের হাতে দেবেন না</li>\n	<li>বিদেশে আপনার কর্মস্থলের ঠিকানা ও ফোন নাম্বার এবং নিয়োগকর্তার বিস্তারিত তথ্য দেশে পরিবারকে জানিয়ে রাখুন</li>\n	<li>অন্যদেশী অভিবাসী শ্রমিকদের সাথে যোগাযোগ রাখুন, তাদের ঠিকানা ও ফোন নাম্বার রাখুন</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>ওয়ার্ক-পারমিট বিষয়ে বিস্তারিত :</strong></h3>\n\n<ul>\n	<li>ওয়ার্ক-পারমিট হলো বিদেশে কাজের অনুমতিপত্র যা সংশিষ্ট দেশের লেবার ডিপার্টমেন্ট থেকে সরবরাহ করা হয়।</li>\n	<li>বিদেশে চাকুরী করার জন্য ওয়ার্ক-পারমিট প্রয়োজন।</li>\n	<li>অনেক দেশেই বিমানবন্দরে শ্রমিকদের ইমিগ্রেশন ক্লিয়ারেন্সের সময় এক বছরের ওয়ার্ক-পারমিট এনডোরস্ড করা হয়।</li>\n	<li>অন্যান্য দেশে লেবার অফিস থেকে এই ওয়ার্ক-পারমিট দেয়া হয়। বিদেশে যাওয়ার সময় যাত্রাপথে করণীয়সমূহ</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>প্রবাসে কাজের সময় কতক্ষন? </strong></h3>\n\n<ul>\n	<li>আন্তর্জাতিক শ্রম আইনে কাজের সময় দৈনিক ৮(আট )ঘন্টা।</li>\n	<li>কিন্তু বাস্তবে পোশাক কারখানা, নির্মাণ কাজ, কৃষি খামারের ক্ষেত্রে শ্রমিকদের বেশি সময়ও কাজ করতে হতে পারে।</li>\n	<li>গৃহকর্মীদের ক্ষেত্রে বাড়ির মালিকের ইচ্ছা অনুযায়ী কাজের সময় নির্ধারিত হয়।</li>\n</ul>\n\n<h3><strong>প্রবাসে বাসস্থান সম্পর্কিত তথ্য :</strong></h3>\n\n<ul>\n	<li>মধ্যপ্রাচ্যের দেশগুলোতে বেশিরভাগ ক্ষেত্রে ক্যাম্পে থাকতে হয়।</li>\n	<li>বাংলাদেশের চাইতে তাপমাত্রা ২ থেকে ৫ ডিগ্রি সেলসিয়াস কমবেশি হয়।</li>\n	<li>দিনে প্রচন্ড গরম এবং রাতে তীব্র শীত অনুভূত হতে পারে।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>প্রবাসে খাদ্য সম্পর্কিত তথ্য :</strong></h3>\n\n<ul>\n	<li>নিয়মিত ভাত খাবার সুযোগ থাকে না। বেশিরভাগ ক্ষেত্রে রুটির ব্যবস্থা থাকে।</li>\n	<li>অনেক নিয়োগকর্তা খাওয়ার ব্যব&macr;হা করে দেন অথবা খাবারের জন্য টাকা দিয়ে দেন।</li>\n	<li>অনেক সময় কোম্পানির দেয়া খাবার খেতে ভাল লাগে না বলে শ্রমিকরা নিজেরাই রান্না করে খেতে পছন্দ করে।</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>প্রবাসে চিকিৎসা সম্পর্কিত তথ্য :</strong></h3>\n\n<ul>\n	<li>চুক্তিপত্র অনুযায়ী নিয়োগকর্তা কতৃক চিকিৎসার ব্যবস্থা করার কথা থাকলেও বেশিরভাগ ক্ষেত্রে কর্মীদেরই চিকিৎসার ব্যয় বহন করতে হয়।</li>\n	<li>সাধারণত এসব দেশের সরকারি হাসপাতালগুলো হেলথ-কার্ডের মাধ্যমে সুলভে অভিবাসী শ্রমিকদের চিকিৎসার ব্যবস্থা করে থাকে।</li>\n	<li>মধ্যপ্রাচ্যের দেশগুলোর জলবায়ু খুব শুস্ক। যাদের ত্বক শুস্ক তাদের জন্য কোনো ক্রিম সাথে নেয়া ভাল।</li>\n	<li>দীর্ঘমেয়াদী রোগ থাকলে (যেমন- হাঁপানি, উচ্চিরক্তচাপ, ডায়াবেটিক ইত্যাদি) দেশ থেকে প্রেসক্রিপশন নিয়ে যাওয়া আবশ্যক।</li>\n	<li>প্রেসক্রিপশন ছাড়া বিদেশে প্রয়োজনীয় ঔষধ ক্রয় করা যায় না।</li>\n</ul>', NULL, NULL, NULL, NULL, '2020-02-25 04:09:31', 1, NULL, NULL, 'বিদেশে-যাওয়ার-পূর্বে-আমি-কি-ধরণের-প্রস্তুতি-নিতে-পারি?', NULL, 1, 1, '1970-01-01', NULL, '2020-02-25 04:09:31', '2020-03-10 17:35:06'),
