(90, 1, NULL, NULL, 'রুম বয়', NULL, 1, NULL, '<h2><strong>Bangladesh Human Capital (BHC)&nbsp;(RL1557)</strong></h2>\n\n<h3><strong>চাকরির প্রসঙ্গ:&nbsp;</strong></h3>\n\n<ul>\n	<li>সৌদি আরবে অবস্থিত ইতালির বিখ্যাত কোম্পানী LIGABUE CATERING COMPANY তে জরুরী ভিত্তিতে কর্মী নিয়োগ চলছে।</li>\n	<li>১০ ঘন্টা (সপ্তাহে ৭ দিন)</li>\n</ul>\n\n<h3><strong>চাকরির ধরন:</strong></h3>\n\n<ul>\n	<li>ফুল টাইম</li>\n</ul>\n\n<h3><strong>কাজের দায়িত্ব:</strong></h3>\n\n<ul>\n	<li>ইংরেজীতে লিখতে ও পড়তে পারদর্শী হতে হবে।</li>\n</ul>\n\n<h3><strong>চাকুরি স্থান:</strong></h3>\n\n<ul>\n	<li>সৌদি আরব</li>\n</ul>\n\n<h3><strong>বেতন:</strong></h3>\n\n<ul>\n	<li>১৩০০/-সৌ: রি:</li>\n</ul>\n\n<h3><strong>অন্যান্য সুবিধা:</strong></h3>\n\n<ul>\n	<li>বাসস্থান, খাবার, চিকিৎসা, পরিবহন, ইকামা, ছুটি কালীন আসা যাওয়া টিকিট ফ্রি</li>\n</ul>\n\n<h3><strong>আবেদন করার আগে পড়ুন:</strong></h3>\n\n<ul>\n	<li>অন্যান্য শর্তাবলী</li>\n	<li>১ বছরের চুক্তি নবায়নযোগ্য।</li>\n	<li>প্রতি বছর ৩০ দিন ছুটি ১ মাসের বেতন সহ।</li>\n	<li>অরিজিনাল পাসপোর্ট, ৫ কপি ল্যাব প্রিন্ট ব্যাকগ্র্যাউন্ড সাদা ছবি সাথে নিয়ে আসতে হবে।</li>\n	<li>এস. এস. সি. বা এইচ. এস. সি. সহ যাবতীয় সার্টিফিকেট এর মূল কপি সাথে নিয়ে আসতে হবে।</li>\n</ul>\n\n<h3><strong>আবেদনের ঠিকানা:</strong></h3>\n\n<ul>\n	<li>বাংলাদেশ হিউম্যান ক্যাপিটাল, (১৫৫৭)<br />\n	এন আই টাওয়ার (১০ তলা)<br />\n	রোড# ১০. প্লট # ১, ব্লক-ই,<br />\n	বনানী. ঢাকা-১২১৩ ফোন #+ ৮৮০২৯৮২০৩৬৭,৮৮০১৬১৪৪২২৪০৪</li>\n</ul>', NULL, NULL, NULL, NULL, '2020-03-03 17:48:55', 1, NULL, 'রুম বয়', 'রুম-বয়', 'http://api.immigration.orangebd.com/images/Mp2Nhnt8ViNMzAwz.png', 1, NULL, '2020-03-31', NULL, '2020-03-03 17:48:55', '2020-03-03 17:48:55'),
