(95, 1, NULL, NULL, 'এসি টেকনিশিয়ান', NULL, 1, NULL, '<h2><strong>রাফিয়া ওভারসীজ&nbsp;</strong>(RL1645)</h2>\n\n<h3><strong>চাকরির প্রসঙ্গ:&nbsp;</strong></h3>\n\n<ul>\n	<li>ভেন্টিলেশন এবং এয়ার কন্ডিশনিং সিস্টেম এবং ইকুইপমেন্ট এর প্রতিস্থাপন,তত্ত্বাবধান এবং মেরামত করা।</li>\n	<li>ইকুইপমেন্ট এর রক্ষণাবেক্ষণ ঝুঁকি চিহ্নিত করা।</li>\n	<li>এইচভিএসি এর জন্য ইলেকট্রিক্যাল এবং মেকানিক্যাল সমস্যা পরীক্ষা করা।</li>\n	<li>সিস্টেম এর পরিষ্কার, এ্যাডজাস্ট ও মেরামত করা এবং ওয়্যারেন্টি সেবার কাজ করা।</li>\n	<li>দ্রুত দক্ষতার সাথে জরুরী মেরামত কাজ করা।</li>\n	<li>টেকনিক্যাল নির্দেশনা প্রদান এবং চলতি কাজ এর উপর প্রশিক্ষণ প্রদান করা।</li>\n	<li>প্রতিদিন এর লগ এবং সকল কাজ তত্ত্বাবধান এর রেকর্ড রাখা।</li>\n	<li>এ্যাপলাইয়েন্স এর মান সাথে কমপ্লাইয়েন্স নিশ্চিত করা এবং স্বাস্থকর পরিবেশ ও নিরাপত্তা এ্যাক্ট এর নিশ্চিত করা।</li>\n	<li>সেবারমান, কাজের নির্দেশনা ও কাস্টমারের চাহিদা এর গুরুত্বপ্রদান করা।</li>\n</ul>\n\n<h3><strong>শিক্ষাগত যোগ্যতা:</strong></h3>\n\n<ul>\n	<li>এসএসসি (ভোকেশনাল)</li>\n</ul>\n\n<h3><strong>চাকরির ধরন:</strong></h3>\n\n<ul>\n	<li>ফুল টাইম</li>\n</ul>\n\n<h3><strong>অভিজ্ঞতা:</strong></h3>\n\n<ul>\n	<li>কমপক্ষে ২ বছর</li>\n	<li>বয়স 22 থেকে 45 বছর</li>\n</ul>\n\n<p><strong>চাকুরি স্থান:</strong></p>\n\n<ul>\n	<li>পাপুয়ানিউগিনি</li>\n</ul>\n\n<h3><strong>বেতন:</strong></h3>\n\n<ul>\n	<li>৬০০০০ টাকা থেকে ৮৫০০০ টাকা আপনার অভিজ্ঞতার উপর নির্ভর করবে।</li>\n	<li>আলোচনা সাপেক্ষে।</li>\n</ul>\n\n<h3><strong>আবেদন করার আগে পড়ুন:</strong></h3>\n\n<ul>\n	<li>অন্যান্য শর্তাবলী</li>\n	<li>১ বছরের চুক্তি নবায়নযোগ্য।</li>\n	<li>প্রতি বছর ৩০ দিন ছুটি ১ মাসের বেতন সহ।</li>\n	<li>অরিজিনাল পাসপোর্ট, ৫ কপি ল্যাব প্রিন্ট ব্যাকগ্র্যাউন্ড সাদা ছবি সাথে নিয়ে আসতে হবে।</li>\n	<li>এস. এস. সি. বা এইচ. এস. সি. সহ যাবতীয় সার্টিফিকেট এর মূল কপি সাথে নিয়ে আসতে হবে।</li>\n</ul>\n\n<h3><strong>আবেদনের ঠিকানা:</strong></h3>\n\n<ul>\n	<li>rafiyatravelsagency@gmail.com</li>\n</ul>', NULL, NULL, NULL, NULL, '2020-03-03 19:01:23', 1, NULL, 'এসি টেকনিশিয়ান', 'এসি-টেকনিশিয়ান', NULL, 1, NULL, '2020-03-28', NULL, '2020-03-03 19:01:23', '2020-03-03 19:01:23'),
(98, 3, NULL, NULL, 'সফল প্রবাসী বাংলাদেশি মোহাম্মাদ ইকবাল হোসেন চৌধুরীর গল্প', NULL, 1, NULL, '<p>দেশের অর্থনীতির চাকা যেসব রেমিট্যান্স যোদ্ধাদের মাধ্যমে গতিশীল হচ্ছে, তাদের মধ্যে একজন অন্যতম চট্টগ্রাম রাঙ্গুনিয়ার মতিউর রহমান চৌধুরীর বড় ছেলে মোহাম্মাদ ইকবাল হোসেন চৌধুরী। দুইবোন ও একভাই মিলে মোট তিনভাই বোনের একটি ছোট্ট পরিবারে বেড়ে উঠা তার।পরিবারের বড় সন্তান হিসেবে পড়ালেখার পাশাপাশি ছাত্র জীবন থেকেই ছোটখাটো ব্যবসা করতেন। পরবর্তীতে কয়েকজন বন্ধুবান্ধব মিলে একটি রিয়েল-এস্টেট ব্যবসা করতেন। বাংলাদেশের ব্যবসায় বড় ধরনের লোকসান হওয়ার পর ঋণের চাপে বাধ্য হয়ে ২০১৭ সালের সেপ্টেম্বর মাসের পাঁচ তারিখে ভাগ্য বদলের আশায় কাতার আসেন।শুরুতে একটি কার ওয়াশের প্রতিষ্ঠান দেন কাতারে। এরপর নিজের অক্লান্ত পরিশ্রম আর দক্ষতার মাধ্যমে নিজেকে এগিয়ে নিয়েছেন সফলতার দ্বারপ্রান্তে। বর্তমানে কাতার, দুবাই ও ওমানে প্রতিষ্ঠিত করেছেন ৯টি কোম্পানি।</p>\n\n<p>ওমানে রুট সিক্সটি সিক্স নামে একটি অত্যাধুনিক কার গ্যারেজ কোম্পানি, গালফ স্টার হাই প্রজেক্ট কোম্পানি, কাতারে ব্রাইট গ্রিন কন্ট্রাকটিং অ্যান্ড সার্ভিস কোম্পানি, ড্রিম টাইপিং সেন্টার অ্যান্ড সার্ভিস কোম্পানি, ইস্ট ওয়েস্ট ক্লিনিং অ্যান্ড হসপিটালিটি কোম্পানি, মেশাল লিমুজিন কোম্পানি, আল খোর দোহা কাতারের একটি এগ্রিকালচার প্রজেক্টসহ বিভিন্ন ব্যবসা প্রতিষ্ঠান পরিচালনা করছেন বাংলাদেশি এই ব্যবসায়ী।</p>\n\n<p>এ ছাড়াও তার আরব আমিরাতে রুট সিক্সটি সিক্স অটো ইলেকট্রিক্যাল অ্যান্ড রিপেয়ারিংয়ের কোম্পানি রয়েছে, যেখানে শুধুমাত্র জার্মান ও আমেরিকান গাড়ির কাজ করা হয়। দুবাইতে তার ডিপ কোয়ালিটি টেকনিক্যাল সার্ভিস নামে আরেকটি কোম্পানি রয়েছে।</p>\n\n<p>মাত্র কয়েক বছর আগে প্রবাসে একজন সাধারণ ক্ষুদ্র ব্যবসায়ী হিসেবে আসলেও চট্টগ্রামের ইকবাল এখন গোটা মধ্যপ্রাচ্যে সফল ব্যবসায়ী। বর্তমানে তার কোম্পানিতে ইন্ডিয়া, পাকিস্তান ও বাংলাদেশসহ মোট তিনটি দেশের সাতশত লোক কাজ করছে, যাদের অধিকাংশই বাংলাদেশি।</p>\n\n<p>বর্তমানে মধ্যপ্রাচ্যের অনেক বড় বড় কোম্পানি যখন শ্রমিকদের বেতন দিতে হিমশিম খাচ্ছে, তখন বাংলাদেশি এই ইকবাল সময় মতো পরিশোধ করছে শ্রমিকদের বেতন। তার ভবিষ্যৎ পরিকল্পনা হচ্ছে মধ্যপ্রাচ্য ছাড়াও মালয়েশিয়া ও সিঙ্গাপুরে নিজস্ব কোম্পানির চালু করা।</p>\n\n<p>অন্যান্য প্রবাসীদের মতো ইকবাল হোসেনেরও দাবি, সরকার থেকে প্রণোদনা নয়, একটু মূল্যায়ন করা হোক। আর সেই সঙ্গে প্রবাসীদের বিমানবন্দরসহ প্রতিটি ক্ষেত্রে হয়রানি বন্ধ করা হোক।</p>', NULL, NULL, NULL, NULL, '2020-03-03 22:44:09', 1, NULL, NULL, 'সফল-প্রবাসী-বাংলাদেশি-মোহাম্মাদ-ইকবাল-হোসেন-চৌধুরীর-গল্প', 'http://api.immigration.orangebd.com/images/tDXgrA5DQS2xXRsL.jpg', 1, 1, '1970-01-01', NULL, '2020-03-03 22:44:09', '2020-03-05 23:21:16'),
